(121, '_transient_feed_66a70e9599b658d5cc038e8074597e7c', 'a:4:{s:5:"child";a:1:{s:0:"";a:1:{s:3:"rss";a:1:{i:0;a:6:{s:4:"data";s:3:"\n\n\n";s:7:"attribs";a:1:{s:0:"";a:1:{s:7:"version";s:3:"2.0";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:1:{s:0:"";a:1:{s:7:"channel";a:1:{i:0;a:6:{s:4:"data";s:49:"\n	\n	\n	\n	\n	\n	\n	\n	\n	\n	\n		\n		\n		\n		\n		\n		\n		\n		\n		\n	";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:21:"WordPress Francophone";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:27:"http://www.wordpress-fr.net";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:70:"La communauté francophone autour du CMS WordPress et son écosystème";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:13:"lastBuildDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 23 May 2016 11:05:10 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"language";a:1:{i:0;a:5:{s:4:"data";s:5:"fr-FR";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:9:"generator";a:1:{i:0;a:5:{s:4:"data";s:27:"http://wordpress.org/?v=4.3";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"item";a:10:{i:0;a:6:{s:4:"data";s:42:"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:21:"Des nouvelles de WPFR";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:67:"http://feedproxy.google.com/~r/WordpressFrancophone/~3/83d0IWEmxkM/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:70:"http://www.wordpress-fr.net/2016/05/23/des-nouvelles-de-wpfr/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 23 May 2016 10:43:36 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:4:"Blog";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:35:"http://www.wordpress-fr.net/?p=7561";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:375:"Le 21 décembre dernier nous avions le plaisir de vous faire partager des informations à propos du renouveau de l&#8217;association WordPress Francophone. Ces derniers mois ont été l&#8217;occasion de tout remettre à plat et nous souhaitions vous donner des nouvelles sur les différents chantiers en cours. C&#8217;est également le moment de faire appel à la [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:15:"Aurélien Denis";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:6880:"<p>Le 21 décembre dernier nous avions le plaisir de vous faire partager des informations à propos du renouveau de l&rsquo;association WordPress Francophone. Ces derniers mois ont été l&rsquo;occasion de tout remettre à plat et nous souhaitions vous donner des nouvelles sur les différents chantiers en cours. C&rsquo;est également le moment de faire appel à la communauté pour constituer des groupes de travail sur les deux chantiers prioritaires : la refonte du site et l&rsquo;avenir du forum.</p>\n<p><span id="more-7561"></span></p>\n<h2>Refonte du site</h2>\n<p>Comme vous le savez tous, le site actuel de l&rsquo;association est dépassé, tant en terme d&rsquo;aspect, qu&rsquo;en terme de fonctionnalités. Au fil du temps le site est devenu compliqué à maintenir &#8211; pour ne pas dire impossible, et les fonctionnalités qu&rsquo;ils proposent ne répondent plus aux besoins réels de la communauté. Il était donc plus que temps d&rsquo;entamer la refonte !</p>\n<p>Nous avons d&rsquo;ores et déjà définis les objectifs du futur site, développé de nouvelles fonctionnalités, et ébauché l&rsquo;arborescence.</p>\n<p>Le site en cours de développement :</p>\n<ul>\n<li>Permettra aux membres de gérer leurs adhésions en ligne ;</li>\n<li>Proposera un annuaire des communautés et des événements ;</li>\n<li>Donnera la possibilité de poster / répondre à des offres d&#8217;emploi ;</li>\n<li>Indiquera de manière claire comment trouver de l&rsquo;aide et comment contribuer à l&rsquo;écosystème WordPress.</li>\n</ul>\n<p>Le site va aussi changer de nom et d&rsquo;URL afin de respecter <a href="https://wordpress.org/about/domains/" target="_blank">les règles de la fondation WordPress concernant la trademark</a>. Vous nous retrouverez bientôt sur <a href="http://wpfr.net" target="_blank">wpfr.net</a> !</p>\n<p>Le chantier est maintenant assez avancé pour proposer à ceux qui le souhaitent de s&rsquo;investir au sein d&rsquo;un groupe de travail dont l&rsquo;objectif est la finalisation de ce nouveau site. Nous cherchons des volontaires :</p>\n<ul>\n<li>3 personnes pour la rédaction des contenus du futur site (les contenus existants sont déjà réimportés sur le site de développement) ;</li>\n<li>2 web-designers pour intervenir sur la charte graphique de l&rsquo;association, et sur la maquette du site.</li>\n</ul>\n<p>Si vous êtes tentés par l&rsquo;aventure, <strong>écrivez-nous à contact[at]wpfr.net</strong>.</p>\n<h2>L&rsquo;avenir du forum</h2>\n<p>Le forum d&rsquo;entraide est la section du site destinée à l&rsquo;accompagnement des utilisateurs francophone du CMS. Si vous rencontrez un soucis dans l&rsquo;utilisation de WordPress, c&rsquo;est un des endroits ou vous trouverez le plus facilement de l&rsquo;aide. Les modérateurs bénévoles y font d&rsquo;ailleurs un travail formidable qu&rsquo;il convient de remercier !</p>\n<p>Malheureusement, l&rsquo;outil qui fait tourner ce forum est lui aussi vieillissant &#8211; il s&rsquo;agit de PunBB. Lors de la refonte <strong>nous devons basculer vers une solution plus moderne</strong>. Le forum existant sera mis en « lecture seule » afin de toujours pouvoir relire les anciens sujets, mais vous ne pourrez plus déposer, ni répondre aux sujets existants.</p>\n<p>Pour le choix, la mise en place et le suivi de cette nouvelle solution, nous souhaitons également constituer un groupe de travail. <strong>Nous invitons celles et ceux qui souhaitent s&rsquo;investir sur la refonte du forum d&rsquo;entraide à nous écrire sur contact[at]wpfr.net</strong>.</p>\n<p>Concernant le débat sur les différents outils disponibles à ce jour pour obtenir du support (forum, Facebook, Twitter, Slack, etc.), nous considérons qu&rsquo;il n&rsquo;a pas lieu d&rsquo;être. C&rsquo;est à chacun d&rsquo;opter pour l&rsquo;outil qui lui convient le mieux avec ses avantages et ses inconvénients.</p>\n<h2>Changement de trésorier</h2>\n<p>Émilie Lebrun a récemment souhaité démissionner du bureau de l&rsquo;association ; c&rsquo;est donc Willy Bahuaud qui a pris la place de trésorier. Le bureau est donc maintenant constitué de Benoît Catherineau (secrétaire), Willy Bahuaud (trésorier) et Aurélien Denis (président).</p>\n<p>Les objectifs de cette équipe reste inchangés <strong>: mettre en place les outils permettant à tous ceux qui le souhaitent, particuliers et entreprises, d&rsquo;adhérer à l&rsquo;association</strong>.</p>\n<p>Nous sommes dans une année de transition tant sur le plan administratif que technique, cela prend du temps mais nous y travaillons.</p>\n<h2>Coup d&rsquo;œil sur le planning</h2>\n<p>Au niveau de la progression des différentes actions, il est important de bien comprendre l&rsquo;imbrication des actions à mener :</p>\n<ul>\n<li>Les changements de statuts et de siège social sont quasiment finalisés, nous attendons la validation officielle de la préfecture ;</li>\n<li>Le transfert du compte bancaire sera effectif sous peu, cela dépendait des statuts ;</li>\n<li>Le nom de domaine et surtout l&rsquo;activation du certificat SSL dépendent de l&rsquo;officialisation du nouveau siège ;</li>\n<li>L&rsquo;ouverture de l&rsquo;association à tous dépend de la mise en ligne d&rsquo;un système pour gérer de manière efficace les adhésions / renouvellements d&rsquo;où la mise en place du groupe de travail pour le site Internet ;</li>\n</ul>\n<p>La <strong>date limite pour postuler est fixée au 31 mai 2016</strong>. Un chef de chantier sera choisi pour tenir informé le bureau des évolutions menées et ainsi communiquer de l&rsquo;état d&rsquo;avancement par l&rsquo;intermédiaire de ce blog.</p>\n<p>Nous sommes à votre disposition pour répondre à toutes vos interrogations et nous comptons sur vous pour que demain WPFR soit votre association aux services de chacun d&rsquo;entre vous !</p>\n<p>&nbsp;</p>\n<div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/WordpressFrancophone?a=83d0IWEmxkM:sWCGB30URXc:yIl2AUoC8zA"><img src="http://feeds.feedburner.com/~ff/WordpressFrancophone?d=yIl2AUoC8zA" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/WordpressFrancophone?a=83d0IWEmxkM:sWCGB30URXc:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/WordpressFrancophone?i=83d0IWEmxkM:sWCGB30URXc:V_sGLiPBpWU" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/WordpressFrancophone?a=83d0IWEmxkM:sWCGB30URXc:qj6IDK7rITs"><img src="http://feeds.feedburner.com/~ff/WordpressFrancophone?d=qj6IDK7rITs" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/WordpressFrancophone?a=83d0IWEmxkM:sWCGB30URXc:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/WordpressFrancophone?i=83d0IWEmxkM:sWCGB30URXc:gIN9vFwOqvQ" border="0"></img></a>\n</div><img src="http://feeds.feedburner.com/~r/WordpressFrancophone/~4/83d0IWEmxkM" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:66:"http://www.wordpress-fr.net/2016/05/23/des-nouvelles-de-wpfr/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:2:"23";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:61:"http://www.wordpress-fr.net/2016/05/23/des-nouvelles-de-wpfr/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:1;a:6:{s:4:"data";s:45:"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:8:"WPFR 2.0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:67:"http://feedproxy.google.com/~r/WordpressFrancophone/~3/jHn6JESKG5o/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:57:"http://www.wordpress-fr.net/2015/12/21/wpfr-2-0/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 21 Dec 2015 11:00:08 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:2:{i:0;a:5:{s:4:"data";s:16:"Association WPFR";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:4:"Blog";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:35:"http://www.wordpress-fr.net/?p=7516";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:422:"Une nouvelle ère s’ouvre pour l’association WordPress Francophone. Un nouveau bureau est en place avec à sa tête : Émilie Lebrun (trésorière), Benoît Catherineau (secrétaire) et moi-même, Aurélien Denis (président). Cette nouvelle aventure sera marquée par la &#171;&#160;professionnalisation&#160;&#187; de la communauté à tous les niveaux : refonte du site communautaire, mise à jour du site [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:15:"Aurélien Denis";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:7431:"<div class="page" title="Page 1">\n<div class="section">\n<div class="layoutArea">\n<div class="column">\n<p>Une nouvelle ère s’ouvre pour l’association WordPress Francophone. Un nouveau bureau est en place avec à sa tête : Émilie Lebrun (trésorière), Benoît Catherineau (secrétaire) et moi-même, Aurélien Denis (président).</p>\n<p>Cette nouvelle aventure sera marquée par la &laquo;&nbsp;professionnalisation&nbsp;&raquo; de la communauté à tous les niveaux : refonte du site communautaire, mise à jour du site localisé de WordPress.org, réflexion sur la création de certifications et autres formations diplômantes, ouverture de l’association aux membres&#8230; sont autant de chantiers que nous avons d’ores et déjà lancés en interne.</p>\n<p>Nous avons fait le choix d’adopter une approche par projets qui devront être menés de front pour donner un nouveau visage à la communauté francophone dans les 6 prochains mois. La masse de travail est conséquente, nous en avons conscience et c’est pour cela que toutes les bonnes volontés seront les bienvenues pour nous épauler dans cette mission. Soyez acteur de votre communauté !</p>\n<p>Comment agir ? Cette question revient souvent lors des nombreux échanges que chacun d’entre nous peuvent avoir, aussi bien de manière virtuelle que réelle. Il me semble opportun de décliner les différents chantiers afin que chacun puisse se positionner sur l’un d’eux.</p>\n<h2>La refonte du site WPFR</h2>\n<p>Disons le clairement : les attentes sont fortes, très fortes ! Contenus dépassés, forum obsolète, absence de services communautaires&#8230; Parmi les changements à venir, nous pouvons retenir :</p>\n<ul>\n<li>Changement du nom de domaine pour se mettre en conformité avec les règles établies par Automattic ;</li>\n<li>Changement de serveur pour de meilleures performances ;</li>\n<li>Bascule progressive du blog, de la vitrine et du forum vers le site fr.wordpress.org ;</li>\n<li>Création d’une nouvelle charte graphique ;</li>\n<li>Refonte technique (responsive design, prise en charge des écrans HDPI, etc.) ;</li>\n<li>Remise à plat fonctionnelle pour répondre à la réalité des besoins de la communauté ;</li>\n<li>Nouvelle stratégie de référencement ;</li>\n</ul>\n<p>L’objectif majeur de cette nouvelle version est le suivant : faire en sorte que chaque membre de la communauté puisse accéder à des services qui le concerne : utilisateurs occasionnels ou passionnés, contributeurs actifs ou en quête de contribution, développeurs de thèmes ou d&rsquo;extensions WordPress, animateurs d’associations locales&#8230; ce site sera le vôtre !</p>\n<h2>La mise à jour du site localisé fr.wordpress.org</h2>\n<p>Il s’agit du site officiel sur lequel vous téléchargez l’archive WordPress avec ses packs de traduction française. Pour les connaisseurs, on parle du site « Rosetta » qui fait référence au nom du thème installé sur ce dernier.</p>\n<p>WPFR a en charge la gestion de ce site et dispose d’une certaine latitude dans l’activation de nouvelles fonctionnalités. Vous aurez sans doute remarqué l’apparition des rubriques Thèmes et Extensions ou encore de contenus réécrits sur les différentes pages de présentation.</p>\n<p>Ce travail est en cours de réalisation par l’équipe de traducteurs bénévoles que sont François-Xavier Bénard, Xavier Borderie et Didier Demory.</p>\n</div>\n</div>\n</div>\n</div>\n<div class="page" title="Page 2">\n<div class="section">\n<div class="layoutArea">\n<div class="column">\n<p>A terme, le blog WPFR rejoindra ce site pour vous tenir informé sur les actualités en lien avec WordPress. De même, il est envisagé de migrer le forum sur cet outil pour se positionner au même niveau que le site WordPress.org dans sa version anglophone. Il sera donc possible d’utiliser votre compte WordPress.org sur les 2 sites. C’est là un chantier immense pour lequel il nous faut prendre des décisions qui auront un impact fort tant pour l’utilisateur que pour les administrateurs.</p>\n<h2>La délivrance de certifications / formations diplômantes</h2>\n<p>Un vaste sujet auquel la communauté francophone de WordPress peut répondre. A l’instar de ce que propose déjà d’autres communautés (SEO Camp) ou des acteurs majeurs du Web (Google, Microsoft, etc.), nous pensons qu’il nous faut délivrer des certifications pour les professionnels WordPress.</p>\n<p>Le but est là encore de professionnaliser les acteurs du Web en France afin de permettre une identification simple et efficace des entreprises compétentes sur le marché par les clients. C’est une demande récurrente de par le monde à laquelle Automattic ne peut répondre : le projet WordPress n’appartient pas à cette multinationale, elle ne fait que le soutenir et n’est donc pas légitime pour établir des certifications comme pourrait le faire Google pour ses services.</p>\n<p>En outre, comme le savent les formateurs WordPress, les réformes successives sur la formation professionnelle nécessitent qu’une formation délivre un diplôme. Maxime Bernard-Jacquet est volontaire pour porter les démarches et des synergies avec <a href="http://www.wp-next.fr/" target="_blank">l’association WP-Next</a> sont à élaborer.</p>\n<h2>L’ouverture des adhésions</h2>\n<p>Jusqu’à aujourd’hui l’association WPFR était fermée et non ouverte aux adhésions. Certains d’entre vous ont rempli un formulaire lors des WordCamps Paris et Lyon cette année. Rassurez-vous nous les avons bien conservés et vous serez contactés en priorité pour adhérer en ligne dès lors que le nouveau site sera disponible. Si vous ne l&rsquo;avez pas encore fait, contactez-nous via notre formulaire de contact.</p>\n<p>Ouvrir une association nécessite de savoir où l’on va tous ensemble, de proposer des services&#8230; autant d’aspects qui restent encore à définir précisément.</p>\n<p>Vous l’aurez compris, les 6 prochains mois seront décisifs ! Vous avez désormais la parole dans les commentaires pour nous faire part de vos remarques, vous positionner sur un chantier pour nous aider ou suggérer de nouvelles idées.</p>\n<p>Enfin, je terminerai par remercier chaleureusement tous ceux qui ont porté l&rsquo;association WPFR durant plus d&rsquo;une décennie. Ils se reconnaîtront sans doute : merci !</p>\n<p>Amicalement,<br />\nLe Président.</p>\n</div>\n</div>\n</div>\n</div>\n<div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/WordpressFrancophone?a=jHn6JESKG5o:rN9c88LUGi4:yIl2AUoC8zA"><img src="http://feeds.feedburner.com/~ff/WordpressFrancophone?d=yIl2AUoC8zA" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/WordpressFrancophone?a=jHn6JESKG5o:rN9c88LUGi4:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/WordpressFrancophone?i=jHn6JESKG5o:rN9c88LUGi4:V_sGLiPBpWU" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/WordpressFrancophone?a=jHn6JESKG5o:rN9c88LUGi4:qj6IDK7rITs"><img src="http://feeds.feedburner.com/~ff/WordpressFrancophone?d=qj6IDK7rITs" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/WordpressFrancophone?a=jHn6JESKG5o:rN9c88LUGi4:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/WordpressFrancophone?i=jHn6JESKG5o:rN9c88LUGi4:gIN9vFwOqvQ" border="0"></img></a>\n</div><img src="http://feeds.feedburner.com/~r/WordpressFrancophone/~4/jHn6JESKG5o" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:53:"http://www.wordpress-fr.net/2015/12/21/wpfr-2-0/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:2:"55";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:48:"http://www.wordpress-fr.net/2015/12/21/wpfr-2-0/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:2;a:6:{s:4:"data";s:45:"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:40:"Sortie de WordPress 4.4 « Clifford »";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:67:"http://feedproxy.google.com/~r/WordpressFrancophone/~3/tgW8c7dvWys/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:81:"http://www.wordpress-fr.net/2015/12/09/sortie-de-wordpress-4-4-clifford/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 09 Dec 2015 19:22:21 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:2:{i:0;a:5:{s:4:"data";s:4:"Blog";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:9:"WordPress";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:35:"http://www.wordpress-fr.net/?p=7508";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:401:"La version 4.4 de WordPress, baptisée “Clifford” en honneur au trompettiste de jazz Clifford Brown, est disponible en téléchargement ou en mise à jour via votre tableau de bord WordPress. Les nouvelles fonctionnalités de la 4.4 vous donnent un site plus connecté et au design adaptatif. Clifford introduit également un nouveau thème par défaut : Twenty Sixteen. Présentation [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:6:"Xavier";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:6445:"<p>La version 4.4 de WordPress, baptisée “Clifford” en honneur au trompettiste de jazz Clifford Brown, est disponible en téléchargement ou en mise à jour via votre tableau de bord WordPress.</p>\n<p>Les nouvelles fonctionnalités de la 4.4 vous donnent un site plus connecté et au design adaptatif. Clifford introduit également un nouveau thème par défaut : Twenty Sixteen.</p>\n<p><iframe src="https://videopress.com/embed/J44FHXvg?hd=0" width="632" height="354.35838150289015" frameborder="0" allowfullscreen="allowfullscreen"></iframe></p>\n<hr />\n<h2>Présentation de  Twenty Sixteen</h2>\n<p><img class="aligncenter size-large wp-image-7512" src="http://www.wordpress-fr.net/wp-content/uploads/2015/12/ipad-white-desktop-2x-1024x6941-500x339.png" alt="ipad-white-desktop-2x-1024x694" width="500" height="339" /></p>\n<p>Le nouveau thème par défaut, Twenty Sixteen, est une modernisation d’un thème de blog classique.</p>\n<p>Twenty Sixteen a été conçu pour être superbe sur tous les appareils. Avec son design en grille fluide, son en-tête flexible et ses jeux de couleurs joyeux, elle mettre en valeur votre contenu.</p>\n<hr />\n<h2>Images adaptatives</h2>\n<p><img class="aligncenter size-large wp-image-7511" src="http://www.wordpress-fr.net/wp-content/uploads/2015/12/responsive-devices-ipad-2x-500x229.png" alt="responsive-devices-ipad-2x" width="500" height="229" /></p>\n<p>WordPress approche désormais l’affichage des images de manières plus intelligente, utilisant à chaque fois la taille d’image la plus pertinente en fonction de l’appareil utilisé. Vous n’avez rien a changer à votre thème : ça fonctionne, c’est tout.</p>\n<hr />\n<h2>Intégrez votre contenu WordPress</h2>\n<div class="embed-container">\n<p>https://make.wordpress.org/core/2015/10/28/new-embeds-feature-in-wordpress-4-4/</p>\n<p>Vous pouvez désormais insérer vos articles dans d’autres sites, et même dans d’autres sites WordPress. Collez simplement l’adresse du contenu dans l’éditeur, et une prévisualisation s’affichera instantanément, avec titre, extrait, et l’image de Une si vous avez mise une. Vous y trouverez même l’icône de votre site et les liens pour commenter et partager.</p>\n</div>\n<p>En plus de l’insertion de contenu, WordPress 4.4 apporte la reconnaissance de cinq nouveaux fournisseurs oEmbed : Cloudup, Reddit Comments, ReverbNation, Speaker Deck et VideoPress.</p>\n<hr />\n<h2>Sous le capot</h2>\n<p><img class="aligncenter size-large wp-image-7513" src="http://www.wordpress-fr.net/wp-content/uploads/2015/12/banner-1544x500-500x162.jpg" alt="banner-1544x500" width="500" height="162" /></p>\n<h3>Infrastructure de l’API REST</h3>\n<p>L’infrastructure de l’API REST a été intégrée au coeur de WordPress, ouvrant ainsi une nouvelle ère pour le développement avec le logiciel. L’API REST a été conçue pour offrir aux développeurs une manière central de construire et étendre des API RESTful basées sur le socle WordPress.</p>\n<p>L’infrastructure est la première partie d’une mise en place en plusieurs étapes de l’API REST. L’inclusion des points d’accès est prévue pour une prochaine version. Pour avoir un aperçu des principaux points d’accès, et pour obtenir plus d’information sur la manière d’étendre l’API REST, découvrez l’extension officielle <a class="thickbox" href="http://xavier.borderie.net/blog/wp-admin/plugin-install.php?tab=plugin-information&amp;plugin=rest-api&amp;TB_iframe=1&amp;width=600&amp;height=550">WordPress REST API</a>.</p>\n<h3>Méta des termes</h3>\n<p>Les termes disposent désormais de métadonnées, tout comme les articles. Lisez la documentation de <a href="https://developer.wordpress.org/reference/functions/add_term_meta"><code>add_term_meta()</code></a>,<a href="https://developer.wordpress.org/reference/functions/get_term_meta"><code>get_term_meta()</code></a> et <a href="https://developer.wordpress.org/reference/functions/update_term_meta"><code>update_term_meta()</code></a>pour plus d&rsquo;information.</p>\n<h3>Amélioration des requêtes de commentaires</h3>\n<p>Les requêtes de commentaires disposent désormais d’un gestionnaire de cache pour améliorer les performances. Les nouveaux arguments de <code>WP_Comment_Query</code> simplifient la mise en place de requêtes de commentaires robustes.</p>\n<div class="feature-section under-the-hood three-col">\n<div class="col">\n<h3>Objets pour les termes, commentaires et réseaux</h3>\n<p>Les nouveaux objets <code>WP_Term</code>, <code>WP_Comment</code>et <code>WP_Network</code> rendent la gestion par le code des termes, commentaires et réseaux plus prévisible et intuitive.</p>\n<h2>L&rsquo;équipe</h2>\n<p><a class="alignleft" href="https://profiles.wordpress.org/wonderboymusic"><img id="grav-ed0f881acb9dc96bee53e4dc61b5558f-0" class="grav-hashed" src="https://www.gravatar.com/avatar/ed0f881acb9dc96bee53e4dc61b5558f?d=mm&amp;s=180&amp;r=G" alt="Scott Taylor" width="80" height="80" /></a>Cette version a été menée par <a href="http://scotty-t.com/">Scott Taylor</a>, avec l&rsquo;aide de plus de 471 contributeurs &#8212; le plus grand nombre jamais vu pour une nouvelle version de WordPress. Parmi eux, on trouve quelques français : Mathieu Viet, Julio Potier, Nicolas Juen, et tous les traducteurs qui ont donné de leur temps pour s&rsquo;assurer que cette version serait traduite dans les temps. Merci à tous !</p>\n</div>\n</div>\n<div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/WordpressFrancophone?a=tgW8c7dvWys:O5SMFkejhIY:yIl2AUoC8zA"><img src="http://feeds.feedburner.com/~ff/WordpressFrancophone?d=yIl2AUoC8zA" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/WordpressFrancophone?a=tgW8c7dvWys:O5SMFkejhIY:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/WordpressFrancophone?i=tgW8c7dvWys:O5SMFkejhIY:V_sGLiPBpWU" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/WordpressFrancophone?a=tgW8c7dvWys:O5SMFkejhIY:qj6IDK7rITs"><img src="http://feeds.feedburner.com/~ff/WordpressFrancophone?d=qj6IDK7rITs" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/WordpressFrancophone?a=tgW8c7dvWys:O5SMFkejhIY:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/WordpressFrancophone?i=tgW8c7dvWys:O5SMFkejhIY:gIN9vFwOqvQ" border="0"></img></a>\n</div><img src="http://feeds.feedburner.com/~r/WordpressFrancophone/~4/tgW8c7dvWys" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:77:"http://www.wordpress-fr.net/2015/12/09/sortie-de-wordpress-4-4-clifford/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"3";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:72:"http://www.wordpress-fr.net/2015/12/09/sortie-de-wordpress-4-4-clifford/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:3;a:6:{s:4:"data";s:42:"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:33:"WordPress fait tourner 25% du web";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:67:"http://feedproxy.google.com/~r/WordpressFrancophone/~3/WIL51xhSWSw/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:81:"http://www.wordpress-fr.net/2015/11/09/wordpress-fait-tourner-25-du-web/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 09 Nov 2015 12:15:20 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:9:"WordPress";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:35:"http://www.wordpress-fr.net/?p=7491";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:341:"Le nombre tant attendu a été atteint ce week-end : selon le site W3Techs, qui présente de nombreuses statistiques et études chiffrées sur les technologies du web, WordPress est aujourd&#8217;hui utilisé par 25% des sites web &#8212; et pas seulement 1/4 des sites qui ont utilisent un outil de gestion de contenu (CMS), non : [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:6:"Xavier";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:5162:"<p>Le nombre tant attendu a été atteint ce week-end : selon le site <a href="http://w3techs.com/">W3Techs</a>, qui présente de nombreuses statistiques et études chiffrées sur les technologies du web, <a href="http://w3techs.com/technologies/history_overview/content_management/all/y">WordPress est aujourd&rsquo;hui utilisé par 25% des sites web</a> &#8212; et pas seulement 1/4 des sites qui ont utilisent un outil de gestion de contenu (CMS), non : 25% de TOUS les sites actuellement en ligne.</p>\n<p><img class="aligncenter wp-image-7492 size-full" src="http://www.wordpress-fr.net/wp-content/uploads/2015/11/wordpress-25pourcent-w3techs-tableau1.png" alt="wordpress-25pourcent-w3techs-tableau1" width="521" height="188" />Le site indique par ailleurs que WordPress a 58,7% de part de marché parmi les sites qui utilisent un CMS, avec l&rsquo;ajout de plus de 1100 sites par jour (dans le top 10 millions des sites).</p>\n<p><img class="aligncenter wp-image-7493 size-full" src="http://www.wordpress-fr.net/wp-content/uploads/2015/11/wordpress-25pourcent-w3techs-tableau2.png" alt="wordpress-25pourcent-w3techs-tableau2" width="509" height="146" /></p>\n<p>C&rsquo;est colossal, et c&rsquo;est le résultat de plusieurs années d&rsquo;amélioration d&rsquo;un projet qui, <a href="http://ma.tt/2015/11/seventy-five-to-go/">comme le rappelle Matt Mullenweg</a>, a commencé <a href="http://zengun.org/weblog/archives/2001/06/post1958/">en juin 2001</a> sous le nom de <a href="http://cafelog.com/">b2/cafelog</a>, dans la chambre du français Michel Valdrighi, alors étudiant sur sa Corse natale (voir <a href="https://wordpress.tv/2012/02/27/les-origines-de-wordpress-la-naissance-de-b2cafelog/">sa conférence sur le sujet au WordCamp Paris 2011</a>).</p>\n<p><img class="aligncenter wp-image-7495 size-full" src="http://www.wordpress-fr.net/wp-content/uploads/2015/11/wordpress-25pourcent-w3techs-graphique1.png" alt="wordpress-25pourcent-w3techs-graphique1" width="765" height="506" /></p>\n<p>Ce qui a commencé comme un script blog personnel utilisé par quelques 3000 personnes au faîte de sa popularité, est aujourd&rsquo;hui l&rsquo;outil choisi par la grande majorité des individus et sociétés quand il s&rsquo;agit de mettre leurs idées et contenus en ligne.</p>\n<p><img class="aligncenter wp-image-7494 size-full" src="http://www.wordpress-fr.net/wp-content/uploads/2015/11/wordpress-25pourcent-w3techs-tableau4.png" alt="wordpress-25pourcent-w3techs-tableau4" width="534" height="228" /></p>\n<p>Matt reprend ensuite : &laquo;&nbsp;Il reste une grosse opportunité à saisir avec les 57% de sites qui n&rsquo;utilisent aucun CMS&nbsp;&raquo;, ou en tout cas aucun d&rsquo;identifiable &#8212; qui pourraient tout aussi bien être des WordPress ou Drupal dont le propriétaire a choisi de cacher son outil. &laquo;&nbsp;Je pense que c&rsquo;est là où nous pouvons avoir une énorme croissance (et je soutiens également tous les autres CMS open-source).&nbsp;&raquo;</p>\n<p><img class="aligncenter size-full wp-image-7496" src="http://www.wordpress-fr.net/wp-content/uploads/2015/11/wordpress-25pourcent-w3techs-tableau3.png" alt="wordpress-25pourcent-w3techs-tableau3" width="469" height="321" /></p>\n<p>À suivre également, <a href="http://trends.builtwith.com/cms/WordPress">les statistiques proposées par Builtwith</a>.</p>\n<p>Ce 25% est un beau nouveau chiffre à ajouter à notre communauté en 2015, avec les 20 ans de PHP&#8230; et les 10 ans de l&rsquo;association WordPress-Francophone (dont vous aurez bientôt des nouvelles, promis !).</p>\n<p>Merci à toutes la communauté de développeurs, de traducteurs, de créateurs d&rsquo;extensions et de thèmes, d&rsquo;accompagnateurs sur les forums, et tant d&rsquo;autres !</p>\n<p>Rendez-vous aux prochains évènements WordPress français afin de fêter cela dignement, à commencer par le <a href="http://2015.wptech.fr/">WP Tech</a> à Nantes le 5 décembre, et le <a href="https://paris.wordcamp.org/2016/">WordCamp Paris</a> les 5 et 6 février 2016, ainsi que tous les autres évènements locaux, petits et grands, organisés par les membres de la grande famille WordPress !</p>\n<div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/WordpressFrancophone?a=WIL51xhSWSw:f1vr0WZxhp4:yIl2AUoC8zA"><img src="http://feeds.feedburner.com/~ff/WordpressFrancophone?d=yIl2AUoC8zA" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/WordpressFrancophone?a=WIL51xhSWSw:f1vr0WZxhp4:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/WordpressFrancophone?i=WIL51xhSWSw:f1vr0WZxhp4:V_sGLiPBpWU" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/WordpressFrancophone?a=WIL51xhSWSw:f1vr0WZxhp4:qj6IDK7rITs"><img src="http://feeds.feedburner.com/~ff/WordpressFrancophone?d=qj6IDK7rITs" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/WordpressFrancophone?a=WIL51xhSWSw:f1vr0WZxhp4:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/WordpressFrancophone?i=WIL51xhSWSw:f1vr0WZxhp4:gIN9vFwOqvQ" border="0"></img></a>\n</div><img src="http://feeds.feedburner.com/~r/WordpressFrancophone/~4/WIL51xhSWSw" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:77:"http://www.wordpress-fr.net/2015/11/09/wordpress-fait-tourner-25-du-web/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"2";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:72:"http://www.wordpress-fr.net/2015/11/09/wordpress-fait-tourner-25-du-web/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:4;a:6:{s:4:"data";s:54:"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n		\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:46:"L’Hebdo WordPress n°263 du 10e anniversaire";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:67:"http://feedproxy.google.com/~r/WordpressFrancophone/~3/ayO_P6QzZyY/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:90:"http://www.wordpress-fr.net/2015/08/28/lhebdo-wordpress-n263-du-10e-anniversaire/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 28 Aug 2015 18:15:50 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:5:{i:0;a:5:{s:4:"data";s:16:"Association WPFR";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:4:"Blog";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:2;a:5:{s:4:"data";s:21:"WordPress Francophone";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:3;a:5:{s:4:"data";s:12:"anniversaire";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:4;a:5:{s:4:"data";s:5:"Hebdo";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:35:"http://www.wordpress-fr.net/?p=7471";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:348:"WPFR a 10 ans ! Il était une fois WordPress Francophone&#8230; Cette histoire a commencé il y a 10 ans par la volonté de quelques utilisateurs qui voulaient avoir un espace d&#8217;échange en français pour ne plus se faire rejeter des forums officiels allergiques aux non anglophones. Et un nouveau site wordpress-fr.net était né ! [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:7:"Benoît";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:12074:"<h3>WPFR a 10 ans !</h3>\n<p>Il était une fois WordPress Francophone&#8230; <a href="http://www.wordpress-fr.net/2005/08/24/le-depart/">Cette histoire a commencé il y a 10 ans</a> par la volonté de quelques utilisateurs qui voulaient avoir un espace d&rsquo;échange en français pour ne plus se faire rejeter des forums officiels allergiques aux non anglophones. <a href="http://www.wordpress-fr.net/2005/08/25/wordpress-frnet/">Et un nouveau site wordpress-fr.net était né </a>!</p>\n<p>10 ans déjà de support en français avec <a href="http://www.wordpress-fr.net/support/">un forum</a> qui est aujourd&rsquo;hui la pierre angulaire de notre communauté. Il représente 7 6741 inscrits pour près de 110 000 discussions ouvertes représentant 560 000 messages.</p>\n<p>WordPress Francophone et son site portail wordpress-fr.net c&rsquo;est aujourd&rsquo;hui une moyenne de près de 200 000 visites par mois pour environ 400 000 pages vues mensuelles.</p>\n<p>WPFR c&rsquo;est aussi une présence sur <a href="https://twitter.com/wordpress_fr">Facebook</a>,<a href="https://twitter.com/wordpress_fr"> sur Twitter</a> et sur <a href="https://plus.google.com/u/0/b/112387028272126355329/112387028272126355329">Google+.</a></p>\n<p>Comme vous l&rsquo;aurez constaté, notre site en général et le forum en particulier sont vieillissants&#8230; cela fait des années qu&rsquo;une refonte est prévue. L&rsquo;évolution de notre association en cours nous donne de bons espoirs pour cette fin d&rsquo;année et le début de la suivante. Des annonces officielles vont suivre. Restez connectés !</p>\n<p>Des projets dans les cartons depuis longtemps devraient pouvoir se concrétiser enfin dans les mois à venir.</p>\n<p>Merci à toutes et tous pour votre fidélité, votre soutien, vos encouragements ou même parfois vos remarques et critiques&#8230; Rien n&rsquo;est vain et WPFR avance, doucement mais surement et cela grâce à vous tous, grâce à la communauté !</p>\n<p><strong>Joyeux anniversaire WPFR</strong> ! 10 ans, c&rsquo;est déjà presque l&rsquo;adolescence ! Longue vie !</p>\n<hr />\n<p>&nbsp;</p>\n<p><span style="text-decoration: underline;"><strong>Place à l&rsquo;hebdo WordPress n°263 :</strong></span></p>\n<h3>La roadmap pour WordPress 4.4</h3>\n<p>Le chantier se poursuit, pas de repos. <a href="https://make.wordpress.org/core/2015/08/27/taxonomy-roadmap-for-4-4-and-beyond/">Voici la feuille de route pour 4.4</a>. (en) &#8230; et on vous demande même votre avis sur <a href="https://make.wordpress.org/core/2015/08/19/wordpress-4-4-whats-on-your-wishlist/">ce que vous voulez voir arriver dans cette future version</a>. (en)</p>\n<h3>Le sondage WordPress 2015</h3>\n<p>Le sondage annuel de WordPress pour recueillir votre avis sur vos habitudes avec WordPress est disponible. <a href="http://wp-survey.polldaddy.com/s/wp-2015">N&rsquo;hésitez pas à le remplir</a>. (en)</p>\n<h3>2016, le prochain thème par défaut</h3>\n<p><a href="https://make.wordpress.org/core/2015/08/25/introducing-twenty-sixteen/">2016 est d&rsquo;ores et déjà mis en chantier</a>. (en)</p>\n<h3>BuddyPress 2.3.3</h3>\n<p>BuddyPress arrive dans sa <a href="https://buddypress.org/2015/08/buddypress-2-3-3/">version 2.3.3</a>. (en)</p>\n<h3>Les mots de passe sous WordPress 4.3</h3>\n<p>La dernière version en date de WordPress introduit <a href="https://make.wordpress.org/core/2015/07/28/passwords-strong-by-default/">une nouvelle gestion des mots de passe</a> (en).</p>\n<h3>Les nouveautés de WordPress 4.3</h3>\n<p>Si vous n&rsquo;êtes pas encore <a href="http://wptavern.com/wordpress-4-3-billie-named-after-jazz-singer-billie-holiday-is-available-for-download">passés (en) </a>à <a href="https://poststatus.com/wordpress-4-3-billie-released/">WordPress 4.3 (en)</a>, <a href="http://www.lumieredelune.com/encrelune/nouveautes-wordpress-4-3,2015,08">voici ce que vous ratez</a> &#8230; quelques <a href="http://wptavern.com/text-patterns-and-the-quick-link-toolbar-in-wordpress-4-3">autres explications</a> (en) ! Mais attention&#8230; <a href="http://www.layerswp.com/2015/08/are-you-ready-for-wordpress-4-3/">soyez sûrs d&rsquo;être prêts (en) </a>! Certains <a href="http://www.lumieredelune.com/encrelune/avertissement-widget-obsolete,2015,08">Widgets peuvent être obsolètes</a> notamment.</p>\n<h3>La check list essentielle pour la mise en place d’un site sous WordPress</h3>\n<p><a href="http://www.vingthuitzerotrois.fr/wordpress/la-check-list-essentielle-pour-la-mise-en-place-dun-site-sous-wordpress-15947/">LA checklist pour le moment fatidique (en) </a>où l&rsquo;on doit mettre en place un site sous WordPress. Pour ne rien oublier !</p>\n<h3>Le BuddyCamp Brighton de iMath</h3>\n<p>Notre iMath national a participé au BuddyCamp de Brighton, <a href="http://imathi.eu/2015/08/10/buddycamp-brighton/">voici son compte rendu</a>.</p>\n<h3>Automattic recrute</h3>\n<p>Automattic <a href="http://ma.tt/2015/08/automattic-is-hiring-2/">recrute différents profils</a>. (en)</p>\n<h3>Désactiver les notifications de YOAST SEO</h3>\n<p>Les notifications intempestives de cette extension pour dérangent ? <a href="http://wpchannel.com/desactiver-notifications-yoast-seo/">voici la solution</a>.</p>\n<h3>Un nouvel événement dédié à REST API</h3>\n<p><a href="http://feelingrestful.com/">A day of Rest est le prochain événement (en) </a>dédié à cette API de WordPress.</p>\n<h3>Inclure l&rsquo;extension REST API dans les thèmes du répertoire officiel ?</h3>\n<p>L&rsquo;équipe en charge des thèmes du répertoire officiel ont voté l&rsquo;autorisation d&rsquo;<a href="http://wptavern.com/wordpress-theme-review-team-votes-to-allow-themes-to-use-the-rest-api-plugin">inclure l&rsquo;extension REST API (en)</a> dans les thèmes du répertoire officiel.</p>\n<h3>Faciliter les invitations Slack</h3>\n<p>Slack est en constante augmentation de popularité. <a href="http://wptavern.com/new-wordpress-plugin-automates-slack-team-invitations">Voici une extension pour simplifier les invitations</a>. (en)</p>\n<h3>WordPress, on a un problème !</h3>\n<p>Ici ce n&rsquo;est pas Houston, mais quand on a un problème avec WordPress que fait-on ? <a href="http://wpformation.com/wordpress-probleme/">Voici des conseils par WPFormation</a>.</p>\n<h3>Les nouveautés de WooCommerce 2.4</h3>\n<p><a href="http://www.absoluteweb.net/woocommerce-2-4-nouveautes/">Découvrez les nouveautés de WooCommerce 2.4 (en).</a></p>\n<h3>Interview de Sara Rosso</h3>\n<p>Sara Rosso de chez Automattic <a href="http://mymorningroutine.com/sara-rosso/">est interviewée par mymorningroutine.com</a>. Interview forcément décalée. ☕</p>\n<h3>Vous n&rsquo;aimez pas les emojis ?</h3>\n<p><a href="http://www.hongkiat.com/blog/disable-wordpress-emoticons/">Désactivez-les !</a> (en)</p>\n<h3>Interview de Miriam Schwab de Illuminea.com</h3>\n<p>Retour d&rsquo;expérience de <a href="http://wptavern.com/wpweekly-episode-205-interview-with-miriam-schwab">Miriam Schwab</a>. (en)</p>\n<h3>WooCommerce : Synchroniser adresses de livraison et de facturation</h3>\n<p>Absolute Web explique <a href="http://www.absoluteweb.net/woocommerce-synchroniser-pays-livraison-facturation/">comment synchroniser les adresses de facturation et de livraison </a>dans WooCommerce.</p>\n<h3>Comment optimiser WordPress ?</h3>\n<p>Korben donne des <a href="http://korben.info/comment-optimiser-un-vieux-wordpress-obese.html">conseils pour alléger et optimiser </a>un vieux WordPress obèse !</p>\n<h3>Quel futur pour WordPress ?</h3>\n<p>Quelques hypothèses pour <a href="http://torquemag.io/where-do-you-see-the-future-of-wordpress/">l&rsquo;avenir de WordPress</a> (en).</p>\n<h3>Ajouter un portfolio</h3>\n<p>Comment ajouter un portflolio dans WordPress ? <a href="http://www.wpbeginner.com/plugins/how-to-add-a-portfolio-to-your-wordpress-site/">Suivez le guide</a>. (en)</p>\n<h3>Retours d&rsquo;expérience</h3>\n<p><a href="http://www.wpelevation.com/2015/08/starting-a-wordpress-consulting-business/">Troy Dean raconte son expérience</a> (en) en tant que consultant WordPress depuis 8 ans. Et Becky Davis nous <a href="http://heropress.com/essays/doing-what-i-want/">raconte son parcours</a>. (en)</p>\n<h3>Interview de Nikolay Bachiyski, chez de la sécurité de WordPress.org</h3>\n<p><a href="http://wptavern.com/short-interview-with-nikolay-bachiyski-wordpress-security-czar">Nikolay est chef de la sécurité</a> de WorPress.org (en).</p>\n<h3>Comment installer une extension ?</h3>\n<p>Il est parfois intéressant de revenir aux bases, c&rsquo;est pourquoi cet article devrait intéressant les <a href="http://yesweblog.fr/wordpress/comment-installer-extension-plugin-wordpress/">débutants qui souhaitent installer des extensions</a>.</p>\n<h3>Présentation de Elegant Themes</h3>\n<p>WP Marmite nous fait découvrir <a href="http://wpmarmite.com/elegant-themes/">Elegant Themes</a>.</p>\n<h3>La hiérarchie des templates</h3>\n<p>La hiérarchie des templates est très importantes dans WordPress. <a href="http://wphierarchy.com/">Voici comment s&rsquo;en imprégner</a>. (en)</p>\n<h3>API personnalisé pour base de données</h3>\n<p>Voici le premier numéro d&rsquo;<a href="https://pippinsplugins.com/custom-database-api-reasons-for-custom-tables-and-an-api/">un tuto sur la gestion des bases de données</a>.</p>\n<h3>Un glossaire pour débutants</h3>\n<p>WordPress vous parle en chinois, et ce malgré la langue sélectionnée avec soin ? Alors <a href="http://www.wpexplorer.com/wordpress-glossary-beginners/">ce guide peut être pour vous</a> ! (en)</p>\n<h3>Un guide pour créer son site e-commerce</h3>\n<p>Si vous voulez quelques idées pour créer votre site e-commerce avec WordPress, <a href="https://selfstartr.com/wordpress-ecommerce/">ce guide pourra vous donner des pistes</a>. (en)</p>\n<h3>25 raisons de passer à WordPress</h3>\n<p>Nelio donne <a href="http://neliosoftware.com/25-reasons-to-switch-to-wordpress/">25 raisons de migrer vers WordPress</a>. (en)</p>\n<h3>Au revoir Thèmes de France</h3>\n<p>Thèmes de France, la plateforme de thèmes WordPress lancées par Alex Bortolotti vient de <a href="https://www.themesdefrance.fr/">fermer définitivement ses portes</a>. Alex nous <a href="http://alexbortolotti.com/pourquoi-arret-themes-de-france/">explique les raisons</a>.</p>\n<h3>Ajouter un retour en haut</h3>\n<p>Thierry propose un bouton pour revenir en <a href="https://gist.github.com/thierrypigot/46a1f71af58c2c83a9a7">haut de page dans Genesis</a>.</p>\n<h3>Il était une fois Automattic&#8230;</h3>\n<p>Automattic c&rsquo;est quoi ? <a href="http://www.elegantthemes.com/blog/editorial/a-history-of-automattics-acquisitions-from-gravatar-to-woothemes">voici une partie de la réponse</a>. (en)</p>\n<h3>Afficher le profil Facebook dans WordPress</h3>\n<p>Si vous souhaitez <a href="http://www.hongkiat.com/blog/facebook-author-tag-wordpress/">afficher le profil Facebook</a> de vos auteurs par exemple, voici comment faire.</p>\n<h3>Top 99 des influenceurs WordPress</h3>\n<p>Les <a href="http://99robots.com/top-99-wordpress-influencers-2015/">99 personnes</a> qui font WordPress ! (en)</p>\n<div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/WordpressFrancophone?a=ayO_P6QzZyY:xNb17R3nBDQ:yIl2AUoC8zA"><img src="http://feeds.feedburner.com/~ff/WordpressFrancophone?d=yIl2AUoC8zA" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/WordpressFrancophone?a=ayO_P6QzZyY:xNb17R3nBDQ:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/WordpressFrancophone?i=ayO_P6QzZyY:xNb17R3nBDQ:V_sGLiPBpWU" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/WordpressFrancophone?a=ayO_P6QzZyY:xNb17R3nBDQ:qj6IDK7rITs"><img src="http://feeds.feedburner.com/~ff/WordpressFrancophone?d=qj6IDK7rITs" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/WordpressFrancophone?a=ayO_P6QzZyY:xNb17R3nBDQ:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/WordpressFrancophone?i=ayO_P6QzZyY:xNb17R3nBDQ:gIN9vFwOqvQ" border="0"></img></a>\n</div><img src="http://feeds.feedburner.com/~r/WordpressFrancophone/~4/ayO_P6QzZyY" height="1" width="1" alt=""/>";s:7:"a