:5:{s:4:"data";s:9:"WordPress";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:35:"http://www.wordpress-fr.net/?p=7463";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:391:"La version 4.3 de WordPress, baptisée &#171;&#160;Billie&#160;&#187; en l&#8217;honneur de la chanteuse de jazz Billie Holiday, est disponible en téléchargement ou en mise à jour via le tableau de bord de votre WordPress. Les nouvelles fonctionnalités de la version 4.3 simplifient grandement la mise en forme de votre contenu et la personnalisation de votre site. Les menus [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:9:"enclosure";a:3:{i:0;a:5:{s:4:"data";s:0:"";s:7:"attribs";a:1:{s:0:"";a:3:{s:3:"url";s:45:"http://s.w.org/images/core/4.3/formatting.mp4";s:6:"length";s:7:"1574782";s:4:"type";s:9:"video/mp4";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:0:"";s:7:"attribs";a:1:{s:0:"";a:3:{s:3:"url";s:45:"http://s.w.org/images/core/4.3/formatting.ogv";s:6:"length";s:7:"1939540";s:4:"type";s:9:"video/ogg";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:2;a:5:{s:4:"data";s:0:"";s:7:"attribs";a:1:{s:0:"";a:3:{s:3:"url";s:46:"http://s.w.org/images/core/4.3/formatting.webm";s:6:"length";s:6:"686435";s:4:"type";s:10:"video/webm";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:6:"Xavier";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:5597:"<p>La version 4.3 de WordPress, baptisée &laquo;&nbsp;Billie&nbsp;&raquo; en l&rsquo;honneur de la chanteuse de jazz <a href="https://fr.wikipedia.org/wiki/Billie_Holiday">Billie Holiday</a>, est disponible en <a href="http://fr.wordpress.org/">téléchargement</a> ou en mise à jour via le tableau de bord de votre WordPress. Les nouvelles fonctionnalités de la version 4.3 simplifient grandement la mise en forme de votre contenu et la personnalisation de votre site.</p>\n<p><iframe width=''555'' height=''312'' src=''https://videopress.com/embed/T54Iy7Tw?hd=1'' frameborder=''0'' allowfullscreen></iframe><script src=''https://v0.wordpress.com/js/next/videopress-iframe.js?m=1435166243''></script></p>\n<h3>Les menus dans l’outil de personnalisation</h3>\n<p><img class="size-large wp-image-7464 alignnone" src="http://www.wordpress-fr.net/wp-content/uploads/2015/08/menu-customizer-500x281.png" alt="menu-customizer" width="500" height="281" /></p>\n<p>Créez votre menu, mettez-le à jour et placez-le, le tout en même temps que vous prévisualisez son apparence dans l’outil de personnalisation. Le design épuré de l’outil de personnalisation offre une interface accessible tant pour les appareils mobiles que pour les utilisateurs en situation de handicap. De version en version, il devient de plus en plus facile de donner à votre l’apparence que vous souhaitez.</p>\n<h3>Les raccourcis de mise en forme</h3>\n\n<p>Votre flux d’écriture va s’accélérer grâce aux nouveaux raccourcis de WordPress 4.3. Utilisez l’astérisque pour créer des listes, et le croisillon pour mettre en place un titre. Votre flux n’est plus ralenti par le mouvement de souris ; votre texte est plus clair grâce aux <code>*</code> et aux <code>#</code>.</p>\n<h3>Des icônes pour votre site</h3>\n<p><img class="size-large wp-image-7465 alignnone" src="http://www.wordpress-fr.net/wp-content/uploads/2015/08/site-icon-customizer-500x281.png" alt="site-icon-customizer" width="500" height="281" /></p>\n<p>Les icônes du site représentent votre site dans les onglets des navigateurs, dans les menus de favoris, et dans la page d’accueil des appareils mobiles. Ajoutez votre propre icône de site dans l’outil de personnalisation ; il restera même en place quand vous changerez de thème. Faites en sorte que tout votre site soit le reflet de votre marque.</p>\n<h3>De meilleurs mots de passe</h3>\n<p><img class="alignnone size-large wp-image-7466" src="http://www.wordpress-fr.net/wp-content/uploads/2015/08/better-passwords-500x281.png" alt="better-passwords" width="500" height="281" /></p>\n<p>Améliorez la sécurité de votre site grâce à la nouvelle gestion des mots de passe de WordPress. Au lieu de recevoir un mot de passe dans votre messagerie, vous recevrez un lien de réinitialisation. Et lorsque vous ajouterez de nouveaux utilisateurs à votre site, ou que vous modifierez le profil d’un utilisateur, WordPress génèrera automatiquement un mot de passe sécurisé.</p>\n<h3>D&rsquo;autres améliorations</h3>\n<ul>\n<li><strong>Une utilisation de l’administration plus agréable </strong>&#8212; Des améliorations à l’affichage des listes sur l’ensemble des pages d’administration rendent WordPress plus accessible et plus facile à utiliser sur n’importe quel appareil.</li>\n<li><strong>Les commentaires sont désactivés sur les pages </strong>&#8212; Toutes les nouvelles pages que vous créerez auront les commentaires désactivés par défaut. Cela permet de limiter les conversations à votre blog, là où elle sont censées se dérouler.</li>\n<li><strong>Une personnalisation rapide de votre site </strong>&#8212; Où que vous soyez sur l’interface du site, vous pouvez cliquer sur le lien de personnalisation dans la barre d’outils pour apporter une modification rapide à votre site.</li>\n<li><strong>Feuille de route de la taxinomie </strong>&#8212; Les termes partagés par plusieurs taxinomies sont maintenant séparés en plusieurs termes distincts.</li>\n<li><strong>Hiérarchie des fichiers du thème </strong>&#8212; Le fichier <code>singular.php</code> a été ajouté en tant qu’alternative à <code>single.php</code> et <code>page.php</code>.</li>\n<li><strong><code>WP_List_Table</code></strong> &#8212; Les tableaux de listes peuvent et doivent désigner une colonne principale.</li>\n</ul>\n<p>Cette version a été menée par <a href="http://konstantin.obenland.it/">Konstantin Obenland</a>, avec l&rsquo;aide 246 contributeurs, parmi lesquels on retrouve quelques français : Clement Biron, Julio Potier, Fabien Quatravaux et Mathieu Viet.</p>\n<div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/WordpressFrancophone?a=KD2NWiu1sHU:oBCnwZX5Yj8:yIl2AUoC8zA"><img src="http://feeds.feedburner.com/~ff/WordpressFrancophone?d=yIl2AUoC8zA" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/WordpressFrancophone?a=KD2NWiu1sHU:oBCnwZX5Yj8:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/WordpressFrancophone?i=KD2NWiu1sHU:oBCnwZX5Yj8:V_sGLiPBpWU" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/WordpressFrancophone?a=KD2NWiu1sHU:oBCnwZX5Yj8:qj6IDK7rITs"><img src="http://feeds.feedburner.com/~ff/WordpressFrancophone?d=qj6IDK7rITs" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/WordpressFrancophone?a=KD2NWiu1sHU:oBCnwZX5Yj8:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/WordpressFrancophone?i=KD2NWiu1sHU:oBCnwZX5Yj8:gIN9vFwOqvQ" border="0"></img></a>\n</div><img src="http://feeds.feedburner.com/~r/WordpressFrancophone/~4/KD2NWiu1sHU" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:75:"http://www.wordpress-fr.net/2015/08/19/sortie-de-wordpress-4-3-billie/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:2:"11";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0