er d&rsquo;une s&eacute;rie de [&hellip;]</p>\n<p>Cet article <a rel="nofollow" href="http://www.geekpress.fr/tutoriel-advanced-custom-fields-debutants/">Advanced Custom Fields pour les d&eacute;butants</a> est apparu en premier sur <a rel="nofollow" href="http://www.geekpress.fr/">GeekPress</a>.</p>\n</div><img src="http://feeds.feedburner.com/~r/wordpress-fr/RaoY/~4/cZNrTh7vX1w" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:66:"http://www.geekpress.fr/tutoriel-advanced-custom-fields-debutants/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:2;a:6:{s:4:"data";s:59:"\n        \n        \n        \n        \n        \n        \n    ";s:7:"attribs";a:1:{s:43:"http://www.w3.org/1999/02/22-rdf-syntax-ns#";a:1:{s:5:"about";s:67:"http://feedproxy.google.com/~r/WordpressFrancophone/~3/83d0IWEmxkM/";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:4:{s:24:"http://purl.org/rss/1.0/";a:3:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:45:"WordPress Francophone : Des nouvelles de WPFR";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:64:"http://feedproxy.google.com/~r/wordpress-fr/RaoY/~3/DhFErLRjsP8/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:7619:"<div>\n<p>Le 21 d&eacute;cembre dernier nous avions le plaisir de vous faire partager des informations &agrave; propos du renouveau de l&rsquo;association WordPress Francophone. Ces derniers mois ont &eacute;t&eacute; l&rsquo;occasion de tout remettre &agrave; plat et nous souhaitions vous donner des nouvelles sur les diff&eacute;rents chantiers en cours. C&rsquo;est &eacute;galement le moment de faire appel &agrave; la communaut&eacute; pour constituer des groupes de travail sur les deux chantiers prioritaires : la refonte du site et l&rsquo;avenir du forum.</p>\n<p><span id="more-7561"></span></p>\n<h2>Refonte du site</h2>\n<p>Comme vous le savez tous, le site actuel de l&rsquo;association est d&eacute;pass&eacute;,&nbsp;tant en terme d&rsquo;aspect, qu&rsquo;en terme de fonctionnalit&eacute;s. Au fil du temps le site est devenu compliqu&eacute; &agrave; maintenir &ndash; pour ne pas dire impossible, et les fonctionnalit&eacute;s qu&rsquo;ils proposent ne r&eacute;pondent plus aux besoins r&eacute;els de la communaut&eacute;. Il &eacute;tait donc plus que temps d&rsquo;entamer la refonte !</p>\n<p>Nous avons d&rsquo;ores et d&eacute;j&agrave; d&eacute;finis les objectifs du futur site, d&eacute;velopp&eacute; de nouvelles fonctionnalit&eacute;s, et &eacute;bauch&eacute;&nbsp;l&rsquo;arborescence.</p>\n<p>Le site en&nbsp;cours de d&eacute;veloppement :</p>\n<ul>\n<li>Permettra aux membres de g&eacute;rer leurs adh&eacute;sions en ligne ;</li>\n<li>Proposera un annuaire des communaut&eacute;s et des &eacute;v&eacute;nements ;</li>\n<li>Donnera la possibilit&eacute; de poster / r&eacute;pondre &agrave; des offres d&rsquo;emploi ;</li>\n<li>Indiquera de mani&egrave;re claire comment trouver de l&rsquo;aide et comment&nbsp;contribuer &agrave; l&rsquo;&eacute;cosyst&egrave;me WordPress.</li>\n</ul>\n<p>Le site va aussi changer de nom et d&rsquo;URL afin de respecter <a href="https://wordpress.org/about/domains/" target="_blank">les r&egrave;gles de la fondation WordPress concernant la trademark</a>. Vous nous retrouverez bient&ocirc;t sur <a href="http://wpfr.net/" target="_blank">wpfr.net</a> !</p>\n<p>Le chantier est maintenant assez avanc&eacute;&nbsp;pour proposer &agrave; ceux qui le souhaitent de s&rsquo;investir au sein d&rsquo;un groupe de travail dont l&rsquo;objectif est la finalisation&nbsp;de ce nouveau site. Nous cherchons des volontaires :</p>\n<ul>\n<li>3 personnes pour la r&eacute;daction des contenus du futur site (les contenus existants sont d&eacute;j&agrave; r&eacute;import&eacute;s sur le site de d&eacute;veloppement) ;</li>\n<li>2 web-designers&nbsp;pour intervenir sur la charte graphique de l&rsquo;association, et sur la maquette du site.</li>\n</ul>\n<p>Si vous &ecirc;tes tent&eacute;s par l&rsquo;aventure, <strong>&eacute;crivez-nous &agrave; contact[at]wpfr.net</strong>.</p>\n<h2>L&rsquo;avenir du forum</h2>\n<p>Le forum d&rsquo;entraide est la section du site destin&eacute;e &agrave; l&rsquo;accompagnement des utilisateurs francophone du CMS. Si vous&nbsp;rencontrez un soucis dans l&rsquo;utilisation de WordPress, c&rsquo;est un des endroits ou vous trouverez le plus facilement de l&rsquo;aide. Les mod&eacute;rateurs b&eacute;n&eacute;voles y font d&rsquo;ailleurs un travail formidable qu&rsquo;il convient de remercier !</p>\n<p>Malheureusement, l&rsquo;outil qui fait tourner ce forum est lui aussi vieillissant &ndash; il s&rsquo;agit de PunBB.&nbsp;Lors de la refonte <strong>nous devons basculer vers une solution plus moderne</strong>. Le forum existant sera mis en &laquo; lecture seule &raquo; afin de toujours pouvoir relire les anciens sujets, mais vous ne pourrez plus d&eacute;poser, ni r&eacute;pondre aux sujets existants.</p>\n<p>Pour le choix, la mise en place et le suivi de cette nouvelle solution, nous souhaitons &eacute;galement&nbsp;constituer un groupe de travail. <strong>Nous invitons celles et ceux qui souhaitent s&rsquo;investir sur la refonte du&nbsp;forum d&rsquo;entraide &agrave; nous &eacute;crire sur contact[at]wpfr.net</strong>.</p>\n<p>Concernant le d&eacute;bat sur les diff&eacute;rents outils disponibles &agrave; ce jour pour obtenir du support (forum, Facebook, Twitter, Slack, etc.), nous consid&eacute;rons qu&rsquo;il n&rsquo;a pas lieu d&rsquo;&ecirc;tre. C&rsquo;est &agrave; chacun d&rsquo;opter pour l&rsquo;outil qui lui convient le mieux avec ses avantages et ses inconv&eacute;nients.</p>\n<h2>Changement de tr&eacute;sorier</h2>\n<p>&Eacute;milie Lebrun a r&eacute;cemment souhait&eacute; d&eacute;missionner du bureau de l&rsquo;association ; c&rsquo;est donc Willy Bahuaud qui a pris la place de tr&eacute;sorier. Le bureau est donc maintenant constitu&eacute; de Beno&icirc;t Catherineau (secr&eacute;taire), Willy Bahuaud (tr&eacute;sorier) et Aur&eacute;lien Denis (pr&eacute;sident).</p>\n<p>Les objectifs de cette &eacute;quipe reste inchang&eacute;s <strong>: mettre en place les outils permettant&nbsp;&agrave; tous ceux qui le souhaitent, particuliers et entreprises, d&rsquo;adh&eacute;rer &agrave; l&rsquo;association</strong>.</p>\n<p>Nous sommes dans une ann&eacute;e de transition tant sur le plan administratif que technique, cela prend du temps mais nous y travaillons.</p>\n<h2>Coup d&rsquo;&oelig;il sur le&nbsp;planning</h2>\n<p>Au niveau de la progression&nbsp;des&nbsp;diff&eacute;rentes actions, il est important de bien comprendre l&rsquo;imbrication des actions &agrave; mener :</p>\n<ul>\n<li>Les changements de statuts et de si&egrave;ge social sont quasiment finalis&eacute;s, nous attendons la validation officielle de la pr&eacute;fecture ;</li>\n<li>Le transfert du compte bancaire sera effectif sous peu, cela d&eacute;pendait des statuts ;</li>\n<li>Le nom de domaine et surtout l&rsquo;activation du certificat SSL d&eacute;pendent de l&rsquo;officialisation du nouveau si&egrave;ge ;</li>\n<li>L&rsquo;ouverture de l&rsquo;association &agrave; tous d&eacute;pend de la mise en ligne d&rsquo;un syst&egrave;me pour g&eacute;rer de mani&egrave;re efficace les adh&eacute;sions / renouvellements d&rsquo;o&ugrave; la mise en place du groupe de travail pour le site Internet ;</li>\n</ul>\n<p>La <strong>date limite pour postuler est fix&eacute;e au 31 mai 2016</strong>. Un chef de chantier sera choisi pour tenir inform&eacute; le bureau des &eacute;volutions men&eacute;es et ainsi communiquer de l&rsquo;&eacute;tat d&rsquo;avancement par l&rsquo;interm&eacute;diaire de ce blog.</p>\n<p>Nous sommes &agrave; votre disposition pour r&eacute;pondre &agrave; toutes vos interrogations et nous comptons sur vous pour que demain WPFR soit votre association aux services de chacun d&rsquo;entre vous !</p>\n<p>&nbsp;</p>\n<div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/WordpressFrancophone?a=83d0IWEmxkM:sWCGB30URXc:yIl2AUoC8zA"><img src="http://feeds.feedburner.com/~ff/WordpressFrancophone?d=yIl2AUoC8zA" border="0"></a> <a href="http://feeds.feedburner.com/~ff/WordpressFrancophone?a=83d0IWEmxkM:sWCGB30URXc:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/WordpressFrancophone?i=83d0IWEmxkM:sWCGB30URXc:V_sGLiPBpWU" border="0"></a> <a href="http://feeds.feedburner.com/~ff/WordpressFrancophone?a=83d0IWEmxkM:sWCGB30URXc:qj6IDK7rITs"><img src="http://feeds.feedburner.com/~ff/WordpressFrancophone?d=qj6IDK7rITs" border="0"></a> <a href="http://feeds.feedburner.com/~ff/WordpressFrancophone?a=83d0IWEmxkM:sWCGB30URXc:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/WordpressFrancophone?i=83d0IWEmxkM:sWCGB30URXc:gIN9vFwOqvQ" border="0"></a>\n</div>\n<img src="http://feeds.feedburner.com/~r/WordpressFrancophone/~4/83d0IWEmxkM" height="1" width="1" alt="">\n</div>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:2:{s:4:"date";a:1:{i:0;a:5:{s:4:"data";s:25:"2016-05-23T12:43:36+00:00";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:15:"Aurélien Denis";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:7723:"<div>\n<p>Le 21 d&eacute;cembre dernier nous avions le plaisir de vous faire partager des informations &agrave; propos du renouveau de l&rsquo;association WordPress Francophone. Ces derniers mois ont &eacute;t&eacute; l&rsquo;occasion de tout remettre &agrave; plat et nous souhaitions vous donner des nouvelles sur les diff&eacute;rents chantiers en cours. C&rsquo;est &eacute;galement le moment de faire appel &agrave; la communaut&eacute; pour constituer des groupes de travail sur les deux chantiers prioritaires : la refonte du site et l&rsquo;avenir du forum.</p>\n<p><span id="more-7561"></span></p>\n<h2>Refonte du site</h2>\n<p>Comme vous le savez tous, le site actuel de l&rsquo;association est d&eacute;pass&eacute;,&nbsp;tant en terme d&rsquo;aspect, qu&rsquo;en terme de fonctionnalit&eacute;s. Au fil du temps le site est devenu compliqu&eacute; &agrave; maintenir &ndash; pour ne pas dire impossible, et les fonctionnalit&eacute;s qu&rsquo;ils proposent ne r&eacute;pondent plus aux besoins r&eacute;els de la communaut&eacute;. Il &eacute;tait donc plus que temps d&rsquo;entamer la refonte !</p>\n<p>Nous avons d&rsquo;ores et d&eacute;j&agrave; d&eacute;finis les objectifs du futur site, d&eacute;velopp&eacute; de nouvelles fonctionnalit&eacute;s, et &eacute;bauch&eacute;&nbsp;l&rsquo;arborescence.</p>\n<p>Le site en&nbsp;cours de d&eacute;veloppement :</p>\n<ul>\n<li>Permettra aux membres de g&eacute;rer leurs adh&eacute;sions en ligne ;</li>\n<li>Proposera un annuaire des communaut&eacute;s et des &eacute;v&eacute;nements ;</li>\n<li>Donnera la possibilit&eacute; de poster / r&eacute;pondre &agrave; des offres d&rsquo;emploi ;</li>\n<li>Indiquera de mani&egrave;re claire comment trouver de l&rsquo;aide et comment&nbsp;contribuer &agrave; l&rsquo;&eacute;cosyst&egrave;me WordPress.</li>\n</ul>\n<p>Le site va aussi changer de nom et d&rsquo;URL afin de respecter <a href="https://wordpress.org/about/domains/" target="_blank">les r&egrave;gles de la fondation WordPress concernant la trademark</a>. Vous nous retrouverez bient&ocirc;t sur <a href="http://wpfr.net/" target="_blank">wpfr.net</a> !</p>\n<p>Le chantier est maintenant assez avanc&eacute;&nbsp;pour proposer &agrave; ceux qui le souhaitent de s&rsquo;investir au sein d&rsquo;un groupe de travail dont l&rsquo;objectif est la finalisation&nbsp;de ce nouveau site. Nous cherchons des volontaires :</p>\n<ul>\n<li>3 personnes pour la r&eacute;daction des contenus du futur site (les contenus existants sont d&eacute;j&agrave; r&eacute;import&eacute;s sur le site de d&eacute;veloppement) ;</li>\n<li>2 web-designers&nbsp;pour intervenir sur la charte graphique de l&rsquo;association, et sur la maquette du site.</li>\n</ul>\n<p>Si vous &ecirc;tes tent&eacute;s par l&rsquo;aventure, <strong>&eacute;crivez-nous &agrave; contact[at]wpfr.net</strong>.</p>\n<h2>L&rsquo;avenir du forum</h2>\n<p>Le forum d&rsquo;entraide est la section du site destin&eacute;e &agrave; l&rsquo;accompagnement des utilisateurs francophone du CMS. Si vous&nbsp;rencontrez un soucis dans l&rsquo;utilisation de WordPress, c&rsquo;est un des endroits ou vous trouverez le plus facilement de l&rsquo;aide. Les mod&eacute;rateurs b&eacute;n&eacute;voles y font d&rsquo;ailleurs un travail formidable qu&rsquo;il convient de remercier !</p>\n<p>Malheureusement, l&rsquo;outil qui fait tourner ce forum est lui aussi vieillissant &ndash; il s&rsquo;agit de PunBB.&nbsp;Lors de la refonte <strong>nous devons basculer vers une solution plus moderne</strong>. Le forum existant sera mis en &laquo; lecture seule &raquo; afin de toujours pouvoir relire les anciens sujets, mais vous ne pourrez plus d&eacute;poser, ni r&eacute;pondre aux sujets existants.</p>\n<p>Pour le choix, la mise en place et le suivi de cette nouvelle solution, nous souhaitons &eacute;galement&nbsp;constituer un groupe de travail. <strong>Nous invitons celles et ceux qui souhaitent s&rsquo;investir sur la refonte du&nbsp;forum d&rsquo;entraide &agrave; nous &eacute;crire sur contact[at]wpfr.net</strong>.</p>\n<p>Concernant le d&eacute;bat sur les diff&eacute;rents outils disponibles &agrave; ce jour pour obtenir du support (forum, Facebook, Twitter, Slack, etc.), nous consid&eacute;rons qu&rsquo;il n&rsquo;a pas lieu d&rsquo;&ecirc;tre. C&rsquo;est &agrave; chacun d&rsquo;opter pour l&rsquo;outil qui lui convient le mieux avec ses avantages et ses inconv&eacute;nients.</p>\n<h2>Changement de tr&eacute;sorier</h2>\n<p>&Eacute;milie Lebrun a r&eacute;cemment souhait&eacute; d&eacute;missionner du bureau de l&rsquo;association ; c&rsquo;est donc Willy Bahuaud qui a pris la place de tr&eacute;sorier. Le bureau est donc maintenant constitu&eacute; de Beno&icirc;t Catherineau (secr&eacute;taire), Willy Bahuaud (tr&eacute;sorier) et Aur&eacute;lien Denis (pr&eacute;sident).</p>\n<p>Les objectifs de cette &eacute;quipe reste inchang&eacute;s <strong>: mettre en place les outils permettant&nbsp;&agrave; tous ceux qui le souhaitent, particuliers et entreprises, d&rsquo;adh&eacute;rer &agrave; l&rsquo;association</strong>.</p>\n<p>Nous sommes dans une ann&eacute;e de transition tant sur le plan administratif que technique, cela prend du temps mais nous y travaillons.</p>\n<h2>Coup d&rsquo;&oelig;il sur le&nbsp;planning</h2>\n<p>Au niveau de la progression&nbsp;des&nbsp;diff&eacute;rentes actions, il est important de bien comprendre l&rsquo;imbrication des actions &agrave; mener :</p>\n<ul>\n<li>Les changements de statuts et de si&egrave;ge social sont quasiment finalis&eacute;s, nous attendons la validation officielle de la pr&eacute;fecture ;</li>\n<li>Le transfert du compte bancaire sera effectif sous peu, cela d&eacute;pendait des statuts ;</li>\n<li>Le nom de domaine et surtout l&rsquo;activation du certificat SSL d&eacute;pendent de l&rsquo;officialisation du nouveau si&egrave;ge ;</li>\n<li>L&rsquo;ouverture de l&rsquo;association &agrave; tous d&eacute;pend de la mise en ligne d&rsquo;un syst&egrave;me pour g&eacute;rer de mani&egrave;re efficace les adh&eacute;sions / renouvellements d&rsquo;o&ugrave; la mise en place du groupe de travail pour le site Internet ;</li>\n</ul>\n<p>La <strong>date limite pour postuler est fix&eacute;e au 31 mai 2016</strong>. Un chef de chantier sera choisi pour tenir inform&eacute; le bureau des &eacute;volutions men&eacute;es et ainsi communiquer de l&rsquo;&eacute;tat d&rsquo;avancement par l&rsquo;interm&eacute;diaire de ce blog.</p>\n<p>Nous sommes &agrave; votre disposition pour r&eacute;pondre &agrave; toutes vos interrogations et nous comptons sur vous pour que demain WPFR soit votre association aux services de chacun d&rsquo;entre vous !</p>\n<p>&nbsp;</p>\n<div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/WordpressFrancophone?a=83d0IWEmxkM:sWCGB30URXc:yIl2AUoC8zA"><img src="http://feeds.feedburner.com/~ff/WordpressFrancophone?d=yIl2AUoC8zA" border="0"></a> <a href="http://feeds.feedburner.com/~ff/WordpressFrancophone?a=83d0IWEmxkM:sWCGB30URXc:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/WordpressFrancophone?i=83d0IWEmxkM:sWCGB30URXc:V_sGLiPBpWU" border="0"></a> <a href="http://feeds.feedburner.com/~ff/WordpressFrancophone?a=83d0IWEmxkM:sWCGB30URXc:qj6IDK7rITs"><img src="http://feeds.feedburner.com/~ff/WordpressFrancophone?d=qj6IDK7rITs" border="0"></a> <a href="http://feeds.feedburner.com/~ff/WordpressFrancophone?a=83d0IWEmxkM:sWCGB30URXc:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/WordpressFrancophone?i=83d0IWEmxkM:sWCGB30URXc:gIN9vFwOqvQ" border="0"></a>\n</div>\n<img src="http://feeds.feedburner.com/~r/WordpressFrancophone/~4/83d0IWEmxkM" height="1" width="1" alt="">\n</div><img src="http://feeds.feedburner.com/~r/wordpress-fr/RaoY/~4/DhFErLRjsP8" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:67:"http://feedproxy.google.com/~r/WordpressFrancophone/~3/83d0IWEmxkM/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:3;a:6:{s:4:"data";s:59:"\n        \