ribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:923:"<div>\n<p>Depuis la version 1.9 de Gravity Forms, il n&rsquo;est plus possible de masquer les labels pour les champs d&rsquo;un formulaire. Cette d&eacute;cision a &eacute;t&eacute; prise afin d&rsquo;am&eacute;liorer l&rsquo;accessibilit&eacute;, notamment pour les personnes malvoyantes. Toutefois, cette option peut nous faire d&eacute;faut dans certains cas. Une ligne de code permet de la r&eacute;tablir, voici donc une astuce [&hellip;]</p>\n<p><a rel="nofollow" href="https://wpchannel.com/author/aurelien-denis/">Aur&eacute;lien Denis</a> - <a rel="nofollow" href="https://wpchannel.com/">WordPress Channel - Tutoriels, th&egrave;mes &amp; plugins WordPress</a> - <a rel="nofollow" href="https://wpchannel.com/masquer-labels-champs-de-gravity-forms/">Masquer les labels des champs de Gravity Forms</a></p>\n</div><img src="http://feeds.feedburner.com/~r/wordpress-fr/RaoY/~4/jVZ7x9M97nA" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:61:"https://wpchannel.com/masquer-labels-champs-de-gravity-forms/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:4;a:6:{s:4:"data";s:59:"\n        \n        \n        \n        \n        \n        \n    ";s:7:"attribs";a:1:{s:43:"http://www.w3.org/1999/02/22-rdf-syntax-ns#";a:1:{s:5:"about";s:50:"http://www.echodesplugins.li-an.fr/news/wp-fr-net/";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:4:{s:24:"http://purl.org/rss/1.0/";a:3:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:85:"L&#039;écho des plugins WordPress : WP-fr.net: y’a-t-il un pilote dans l’avion ?";s:7:"attribs";a:0:{}s:8:"xml_base"