dPress Translation Day";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:64:"http://feedproxy.google.com/~r/wordpress-fr/RaoY/~3/zymro15RRsU/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:4206:"<div>\n<p>Le GWTD s&rsquo;est tenu le 24 avril dernier. Cette premi&egrave;re &eacute;dition a &eacute;t&eacute; un v&eacute;ritable succ&egrave;s si l&rsquo;on se r&eacute;f&egrave;re aux chiffres du document ci-dessous :<br><a href="https://fr.wordpress.org/files/2016/05/WPGTD-EN-FR.jpg"><img class="aligncenter wp-image-479 size-large" src="https://fr.wordpress.org/files/2016/05/WPGTD-EN-FR-770x1024.jpg" alt="WPGTD-EN-FR" width="692" height="920" srcset="https://fr.wordpress.org/files/2016/05/WPGTD-EN-FR-770x1024.jpg 770w, https://fr.wordpress.org/files/2016/05/WPGTD-EN-FR-226x300.jpg 226w, https://fr.wordpress.org/files/2016/05/WPGTD-EN-FR-768x1021.jpg 768w, https://fr.wordpress.org/files/2016/05/WPGTD-EN-FR.jpg 1000w" sizes="(max-width: 692px) 100vw, 692px"></a></p>\n<h2>Pour ce qui est de la communaut&eacute; fran&ccedil;aise&nbsp;:</h2>\n<p>Cette journ&eacute;e a &eacute;t&eacute; un v&eacute;ritable plaisir &agrave; organiser et &agrave; animer, riche en rencontres, en adaptations aux attentes et besoins de toutes les personnes pr&eacute;sentes au Node de Bordeaux.</p>\n<ul>\n<li>22 extensions et th&egrave;mes ont &eacute;t&eacute; traduits et valid&eacute;s.</li>\n<li>3 traducteurs ont rejoint l&rsquo;&eacute;quipe des responsables de traduction en tant que PTE.</li>\n<li>Le glossaire a &eacute;t&eacute; actualis&eacute;.</li>\n<li>Une &eacute;bauche de travail sur les termes &eacute;pic&egrave;nes a &eacute;t&eacute; lanc&eacute;e.</li>\n<li>Un <a href="https://docs.google.com/spreadsheets/d/1NjmkCg7qHuTALBC3DES6mQLIq6xsq6xr9Bq4JOa4Wlk/edit#gid=0">Google doc</a> a &eacute;t&eacute; cr&eacute;&eacute; &agrave; l&rsquo;occasion pour regrouper les termes qui n&eacute;cessitent d&rsquo;&ecirc;tre int&eacute;gr&eacute;s au glossaire ou dans la r&eacute;flexion sur les termes &eacute;pic&egrave;nes.</li>\n</ul>\n<p>Mais au final, c&rsquo;est surtout une Communaut&eacute; de traducteurs et de traductrices que j&rsquo;ai vu travailler ensemble, curieuse et motiv&eacute;e pour <strong>vous</strong> fournir les meilleures trads possibles. Et &ccedil;a, cela ne se chiffre pas et cela vaut toutes les statistiques que vous voulez.</p>\n<p>Alors encore merci @sharebordeaux, @alysko (et &agrave; toute sa famille), @<span class="message_body">juliefrance33, @crash_47 (et &agrave; toute sa famille), @nicolasricher, @bastienho, @Geronimo (et &agrave; Abi), @css31, * </span></p>\n<p>Une sp&eacute;ciale d&eacute;dicace @rashely pour nous avoir donn&eacute; acc&egrave;s au Node et @wolforg (wolfrog pour l&rsquo;occasion) qui a tenu le rythme des validations tout au long de la journ&eacute;e via le Slack de la communaut&eacute;.</p>\n<p>Je vous donne rendez-vous l&rsquo;ann&eacute;e prochaine pour un nouveau GWTD et pr&eacute;parez-vous &agrave; des changements dans les traductions dans les prochaines versions de WordPress <img src="https://s.w.org/images/core/emoji/72x72/1f642.png" alt="&#128578;" class="wp-smiley" style="height: 1em; max-height: 1em;"></p>\n<p>Et en attendant si vous voulez revoir la session consacr&eacute;e &agrave; la traduction fran&ccedil;aise, la vid&eacute;o est disponible <a href="https://www.crowdcast.io/e/wptranslationday/register">ici</a> et les slides <a href="https://fxbenard.com/traduire-wordpress-francais/">ici</a>.</p>\n<p><a href="https://fr.wordpress.org/files/2016/05/WPGTD-FR.jpg"><img class="aligncenter wp-image-480 size-large" src="https://fr.wordpress.org/files/2016/05/WPGTD-FR-770x1024.jpg" alt="WPGTD-FR" width="692" height="920" srcset="https://fr.wordpress.org/files/2016/05/WPGTD-FR-770x1024.jpg 770w, https://fr.wordpress.org/files/2016/05/WPGTD-FR-226x300.jpg 226w, https://fr.wordpress.org/files/2016/05/WPGTD-FR-768x1021.jpg 768w, https://fr.wordpress.org/files/2016/05/WPGTD-FR.jpg 1000w" sizes="(max-width: 692px) 100vw, 692px"></a>** Je tenais &agrave; m&rsquo;excuser aupr&egrave;s des personnes que j&rsquo;aurais pu oublier de nommer et qui &eacute;taient pr&eacute;sentes lors de cette journ&eacute;e. N&rsquo;h&eacute;sitez pas &agrave; m&rsquo;indiquer vos pseudos sur le Slack #gtd, je les ajouterais dans l&rsquo;article. Big up &agrave; notre am&eacute;ricain de passage et &agrave; notre typographe.</p>\n</div>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:2:{s:4:"date";a:1:{i:0;a:5:{s:4:"data";s:25:"2016-05-18T08:57:05+00:00";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:8:"fxbenard";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:4310:"<div>\n<p>Le GWTD s&rsquo;est tenu le 24 avril dernier. Cette premi&egrave;re &eacute;dition a &eacute;t&eacute; un v&eacute;ritable succ&egrave;s si l&rsquo;on se r&eacute;f&egrave;re aux chiffres du document ci-dessous :<br><a href="https://fr.wordpress.org/files/2016/05/WPGTD-EN-FR.jpg"><img class="aligncenter wp-image-479 size-large" src="https://fr.wordpress.org/files/2016/05/WPGTD-EN-FR-770x1024.jpg" alt="WPGTD-EN-FR" width="692" height="920" srcset="https://fr.wordpress.org/files/2016/05/WPGTD-EN-FR-770x1024.jpg 770w, https://fr.wordpress.org/files/2016/05/WPGTD-EN-FR-226x300.jpg 226w, https://fr.wordpress.org/files/2016/05/WPGTD-EN-FR-768x1021.jpg 768w, https://fr.wordpress.org/files/2016/05/WPGTD-EN-FR.jpg 1000w" sizes="(max-width: 692px) 100vw, 692px"></a></p>\n<h2>Pour ce qui est de la communaut&eacute; fran&ccedil;aise&nbs