ns de WordPress <img src="https://s.w.org/images/core/emoji/72x72/1f642.png" alt="&#128578;" class="wp-smiley" style="height: 1em; max-height: 1em;"></p>\n<p>Et en attendant si vous voulez revoir la session consacr&eacute;e &agrave; la traduction fran&ccedil;aise, la vid&eacute;o est disponible <a href="https://www.crowdcast.io/e/wptranslationday/register">ici</a> et les slides <a href="https://fxbenard.com/traduire-wordpress-francais/">ici</a>.</p>\n<p><a href="https://fr.wordpress.org/files/2016/05/WPGTD-FR.jpg"><img class="aligncenter wp-image-480 size-large" src="https://fr.wordpress.org/files/2016/05/WPGTD-FR-770x1024.jpg" alt="WPGTD-FR" width="692" height="920" srcset="https://fr.wordpress.org/files/2016/05/WPGTD-FR-770x1024.jpg 770w, https://fr.wordpress.org/files/2016/05/WPGTD-FR-226x300.jpg 226w, https://fr.wordpress.org/files/2016/05/WPGTD-FR-768x1021.jpg 768w, https://fr.wordpress.org/files/2016/05/WPGTD-FR.jpg 1000w" sizes="(max-width: 692px) 100vw, 692px"></a>** Je tenais &agrave; m&rsquo;excuser aupr&egrave;s des personnes que j&rsquo;aurais pu oublier de nommer et qui &eacute;taient pr&eacute;sentes lors de cette journ&eacute;e. N&rsquo;h&eacute;sitez pas &agrave; m&rsquo;indiquer vos pseudos sur le Slack #gtd, je les ajouterais dans l&rsquo;article. Big up &agrave; notre am&eacute;ricain de passage et &agrave; notre typographe.</p>\n</div><img src="http://feeds.feedburner.com/~r/wordpress-fr/RaoY/~4/zymro15RRsU" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:79:"https://fr.wordpress.org/2016/05/18/retour-du-global-wordpress-translation-day/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:6;a:6:{s:4:"data";s:59:"\n        \n        \n        \n        \n        \n        \n    ";s:7:"attribs";a:1:{s:43:"http://www.w3.org/1999