ta";s:59:"\n        \n        \n        \n        \n        \n        \n    ";s:7:"attribs";a:1:{s:43:"http://www.w3.org/1999/02/22-rdf-syntax-ns#";a:1:{s:5:"about";s:56:"https://fr.wordpress.org/2016/04/22/guide-de-traduction/";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:4:{s:24:"http://purl.org/rss/1.0/";a:3:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:31:"Français : Guide de traduction";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:64:"http://feedproxy.google.com/~r/wordpress-fr/RaoY/~3/plXefeEUNpA/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:5382:"<div>\n<p>Vous voulez participer &agrave; l&rsquo;effort de traduction de WordPress, voici quelques consignes &agrave; lire avant de vous lancer&nbsp;! Cela nous permettra d&rsquo;avancer plus vite ensemble.</p>\n<h2>Recommandations g&eacute;n&eacute;rales&nbsp;:</h2>\n<ul>\n<li>Suivre le <a href="https://translate.wordpress.org/projects/wp/dev/fr/default/glossary">glossaire du c&oelig;ur</a> de WordPress, il constitue la ligne directrice de la traduction de WordPress.</li>\n<li>Privil&eacute;gier un langage informel. Le &laquo;&nbsp;vous&nbsp;&raquo; plut&ocirc;t que le &laquo;&nbsp;tu&nbsp;&raquo;.</li>\n<li><span id="noHighlight_0.035164427130292775">La traduction doit &ecirc;tre facile &agrave; lire et &agrave; comprendre, m&ecirc;me pour les utilisateurs qui n&rsquo;ont pas de bagage technique sp&eacute;cifique.</span></li>\n<li><span id="noHighlight_0.5555640589950441">Utiliser des phrases courtes et claires.<br></span></li>\n<li>&Eacute;viter la voix passive et les phrases trop longues.</li>\n<li><span id="noHighlight_0.23988121876731583">Le ton doit refl&eacute;ter celui du texte original.</span></li>\n<li>Ne pas incorporer d&rsquo;URL modifi&eacute;es.</li>\n<li>Ne pas traduire litt&eacute;ralement. &Eacute;viter la translitt&eacute;ration (plugin).</li>\n<li>Ne pas traduire le nom des th&egrave;mes, extensions.</li>\n<li>Faites-vous plaisir.</li>\n<li><strong>Inspirez-vous de la <a href="https://translate.wordpress.org/locale/fr/default/wp">traduction du c&oelig;ur</a> de WordPress.</strong></li>\n</ul>\n<h2>Recommandations sp&eacute;cifiques&nbsp;:</h2>\n<ul>\n<li>Les services de traduction automatique (Google, Yahoo, bing translate).</li>\n</ul>\n<p>Nous ne recommandons pas l&rsquo;utilisation de ces services qui ne fournissent pas la qualit&eacute; de traduction que nous voulons fournir aux utilisateurs de WordPress.</p>\n<ul>\n<li>Les balises (attention au s%).</li>\n</ul>\n<p>Les chaines &agrave; traduire peuvent contenir des balises sp&eacute;cifiques %s, %1$s ou HTML&hellip;<br>\nIl est important de ne pas les modifier et de respecter leurs espaces.</p>\n<ul>\n<li>Les commentaires et le contexte.</li>\n</ul>\n<p>Pour comprendre ces balises et aussi l&rsquo;ensemble des chaines, il est important de se r&eacute;f&eacute;rer aux commentaires et au contexte laiss&eacute;s par les d&eacute;veloppeurs. Ils sont l&agrave; pour vous aider alors utilisez-les.</p>\n<p><a href="https://fr.wordpress.org/files/2016/04/regles-trad-fr.png"><img class="aligncenter wp-image-425 size-large" src="https://fr.wordpress.org/files/2016/04/regles-trad-fr-1024x354.png" alt="R&egrave;gles-trad-fr" width="692" height="239" srcset="https://fr.wordpress.org/files/2016/04/regles-trad-fr-1024x354.png 1024w, https://fr.wordpress.org/files/2016/04/regles-trad-fr-300x104.png 300w, https://fr.wordpress.org/files/2016/04/regles-trad-fr-768x265.png 768w, https://fr.wordpress.org/files/2016/04/regles-trad-fr.png 1189w" sizes="(max-width: 692px) 100vw, 692px"></a></p>\n<ul>\n<li>Traduisez uniquement ce que vous comprenez.</li>\n</ul>\n<p>En cas de doute sur une chaine, passez &agrave; la suivante. Un autre polyglotte pourra le faire pour vous. Nous travaillons en &eacute;quipe.</p>\n<ul>\n<li>L&rsquo;infinitif ou l&rsquo;imp&eacute;ratif.</li>\n</ul>\n<p>Utilisez l&rsquo;infinitif pour tout ce qui touche &agrave; une action li&eacute;e &agrave; un bouton.</p>\n<p>Exemple&nbsp;: Enregistrer les changements</p>\n<p>Utilisez l&rsquo;imp&eacute;ratif pour tout ce qui concerne des aides, conseils (souvent en italique dans l&rsquo;admin).</p>\n<p>Exemple&nbsp;: Glissez chaque &eacute;l&eacute;ment pour les placer dans l&rsquo;ordre que vous pr&eacute;f&eacute;rez.</p>\n<ul>\n<li>Typographie.</li>\n</ul>\n<p>Pour r&eacute;sumer&nbsp;:</p>\n<p><a href="https://fr.wordpress.org/files/2016/04/4-caracteres.jpg"><img class="alignright size-medium wp-image-447" src="https://fr.wordpress.org/files/2016/04/4-caracteres-300x115.jpg" alt="Caract&egrave;res (props @hoffmanjeff)" width="300" height="115" srcset="https://fr.wordpress.org/files/2016/04/4-caracteres-300x115.jpg 300w, https://fr.wordpress.org/files/2016/04/4-caracteres-768x294.jpg 768w, https://fr.wordpress.org/files/2016/04/4-caracteres.jpg 1002w" sizes="(max-width: 300px) 100vw, 300px"></a></p>\n<ol>\n<li>Des guillemets typographiques &laquo;&nbsp;&raquo;.</li>\n<li>Des espaces ins&eacute;cables devant les&nbsp;; :&nbsp;! ?</li>\n<li>Des apostrophes typographiques &rsquo;.</li>\n<li>Des majuscules uniquement en d&eacute;but de phrase.</li>\n<li>Des points en fin de phrases.</li>\n</ol>\n<p>Le guide typographique complet est consultable <a href="https://fr.wordpress.org/2016/04/22/regles-typographiques-de-base/">ici</a>.</p>\n<ul>\n<li><strong>Nous sommes disponibles.</strong></li>\n</ul>\n<p><strong>Si vous avez des questions sur un terme, une chaine, une fa&ccedil;on de faire, des suggestions g&eacute;n&eacute;rales ou sp&eacute;cifiques, n&rsquo;h&eacute;sitez pas &agrave; nous rejoindre sur le <a href="http://www.wpwild.fr/wp-login.php?action=slack-invitation">Slack fran&ccedil;ais</a>, nous serons heureux de vous y retrouver.</strong></p>\n<p>Et si vous n&rsquo;&ecirc;tes pas trop Slack, vous pouvez utiliser les <a href="http://www.wordpress-fr.net/support/">forums de la communaut&eacute; francophone</a> de WordPress. Les membres de la communaut&eacute; se feront un plaisir de vous y r&eacute;pondre.</p>\n</div>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:2:{s:4:"date";a:1:{i:0;a:5:{s:4:"data";s:25:"2016-04-22T11:30:03+00:00";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:8:"fxbenard";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:5486:"<div>\n<p>Vous voulez participer &agrave; l&rsquo;effort de traduction de WordPress, voici quelques consignes &agrave; lire avant de vous lancer&nbsp;! Cela nous permettra d&rsquo;avancer plus vite ensemble.</p>\n<h2>Recommandations g&eacute;n&eacute;rales&nbsp;:</h2>\n<ul>\n<li>Suivre le <a href="https://translate.wordpress.org/projects/wp/dev/fr/default/glossary">glossaire du c&oelig;ur</a> de WordPress, il constitue la ligne directrice de la traduction de WordPress.</li>\n<li>Privil&eacute;gier un langage informel. Le &laquo;&nbsp;vous&nbsp;&raquo; plut&ocirc;t que le &laquo;&nbsp;tu&nbsp;&raquo;.</li>\n<li><span id="noHighlight_0.035164427130292775">La traduction doit &ecirc;tre facile &agrave; lire et &agrave; comprendre, m&ecirc;me pour les utilisateurs qui n&rsquo;ont pas de bagage technique sp&eacute;cifique.</span></li>\n<li><span id="noHighlight_0.5555640589950441">Utiliser des phrases courtes et claires.<br></span></li>\n<li>&Eacute;viter la voix passive et les phrases trop longues.</li>\n<li><span id="noHighlight_0.23988121876731583">Le ton doit refl&eacute;ter celui du texte original.</span></li>\n<li>Ne pas incorporer d&rsquo;URL modifi&eacute;es.</li>\n<li>Ne pas traduire litt&eacute;ralement. &Eacute;viter la translitt&eacute;ration (plugin).</li>\n<li>Ne pas traduire le nom des th&egrave;mes, extensions.</li>\n<li>Faites-vous plaisir.</li>\n<li><strong>Inspirez-vous de la <a href="https://translate.wordpress.org/locale/fr/default/wp">traduction du c&oelig;ur</a> de WordPress.</strong></li>\n</ul>\n<h2>Recommandations sp&eacute;cifiques&nbsp;:</h2>\n<ul>\n<li>Les services de traduction automatique (Google, Yahoo, bing translate).</li>\n</ul>\n<p>Nous ne recommandons pas l&rsquo;utilisation de ces services qui ne fournissent pas la qualit&eacute; de traduction que nous voulons fournir aux utilisateurs de WordPress.</p>\n<ul>\n<li>Les balises (attention au s%).</li>\n</ul>\n<p>Les chaines &agrave; traduire peuvent contenir des balises sp&eacute;cifiques %s, %1$s ou HTML&hellip;<br>\nIl est important de ne pas les modifier et de respecter leurs espaces.</p>\n<ul>\n<li>Les commentaires et le contexte.</li>\n</ul>\n<p>Pour comprendre ces balises et aussi l&rsquo;ensemble des chaines, il est important de se r&eacute;f&eacute;rer aux commentaires et au contexte laiss&eacute;s par les d&eacute;veloppeurs. Ils sont l&agrave; pour vous aider alors utilisez-les.</p>\n<p><a href="https://fr.wordpress.org/files/2016/04/regles-trad-fr.png"><img class="aligncenter wp-image-425 size-large" src="https://fr.wordpress.org/files/2016/04/regles-trad-fr-1024x354.png" alt="R&egrave;gles-trad-fr" width="692" height="239" srcset="https://fr.wordpress.org/files/2016/04/regles-trad-fr-1024x354.png 1024w, https://fr.wordpress.org/files/2016/04/regles-trad-fr-300x104.png 300w, https://fr.wordpress.org/files/2016/04/regles-trad-fr-768x265.png 768w, https://fr.wordpress.org/files/2016/04/regles-trad-fr.png 1189w" sizes="(max-width: 692px) 100vw, 692px"></a></p>\n<ul>\n<li>Traduisez uniquement ce que vous comprenez.</li>\n</ul>\n<p>En cas de doute sur une chaine, passez &agrave; la suivante. Un autre polyglotte pourra le faire pour vous. Nous travaillons en &eacute;quipe.</p>\n<ul>\n<li>L&rsquo;infinitif ou l&rsquo;imp&eacute;ratif.</li>\n</ul>\n<p>Utilisez l&rsquo;infinitif pour tout ce qui touche &agrave; une action li&eacute;e &agrave; un bouton.</p>\n<p>Exemple&nbsp;: Enregistrer les changements</p>\n<p>Utilisez l&rsquo;imp&eacute;ratif pour tout ce qui concerne des aides, conseils (souvent en italique dans l&rsquo;admin).</p>\n<p>Exemple&nbsp;: Glissez chaque &eacute;l&eacute;ment pour les placer dans l&rsquo;ordre que vous pr&eacute;f&eacute;rez.</p>\n<ul>\n<li>Typographie.</li>\n</ul>\n<p>Pour r&eacute;sumer&nbsp;:</p>\n<p><a href="https://fr.wordpress.org/files/2016/04/4-caracteres.jpg"><img class="alignright size-medium wp-image-447" src="https://fr.wordpress.org/files/2016/04/4-caracteres-300x115.jpg" alt="Caract&egrave;res (props @hoffmanjeff)" width="300" height="115" srcset="https://fr.wordpress.org/files/2016/04/4-caracteres-300x115.jpg 300w, https://fr.wordpress.org/files/2016/04/4-caracteres-768x294.jpg 768w, https://fr.wordpress.org/files/2016/04/4-caracteres.jpg 1002w" sizes="(max-width: 300px) 100vw, 300px"></a></p>\n<ol>\n<li>Des guillemets typographiques &laquo;&nbsp;&raquo;.</li>\n<li>Des espaces ins&eacute;cables devant les&nbsp;; :&nbsp;! ?</li>\n<li>Des apostrophes typographiques &rsquo;.</li>\n<li>Des majuscules uniquement en d&eacute;but de phrase.</li>\n<li>Des points en fin de phrases.</li>\n</ol>\n<p>Le guide typographique complet est consultable <a href="https://fr.wordpress.org/2016/04/22/regles-typographiques-de-base/">ici</a>.</p>\n<ul>\n<li><strong>Nous sommes disponibles.</strong></li>\n</ul>\n<p><strong>Si vous avez des questions sur un terme, une chaine, une fa&ccedil;on de faire, des suggestions g&eacute;n&eacute;rales ou sp&eacute;cifiques, n&rsquo;h&eacute;sitez pas &agrave; nous rejoindre sur le <a href="http://www.wpwild.fr/wp-login.php?action=slack-invitation">Slack fran&ccedil;ais</a>, nous serons heureux de vous y retrouver.</strong></p>\n<p>Et si vous n&rsquo;&ecirc;tes pas trop Slack, vous pouvez utiliser les <a href="http://www.wordpress-fr.net/support/">forums de la communaut&eacute; francophone</a> de WordPress. Les membres de la communaut&eacute; se feront un plaisir de vous y r&eacute;pondre.</p>\n</div><img src="http://feeds.feedburner.com/~r/wordpress-fr/RaoY/~4/plXefeEUNpA" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:56:"https://fr.wordpress.org/2016/04/22/guide-de-traduction/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:19;a:6:{s:4:"data";s:59:"\n        \n        \n        \n        \n        \n        \n    ";s:7:"attribs";a:1:{s:43:"http://www.w3.org/1999/02/22-rdf-syntax-ns#";a:1:{s:5:"about";s:66:"https://fr.wordpress.org/2016/04/22/regles-typographiques-de-base/";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:4:{s:24:"http://purl.org/rss/1.0/";a:3:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:42:"Français : Règles typographiques de base";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:64:"http://feedproxy.google.com/~r/wordpress-fr/RaoY/~3/WNwSXxGC3kw/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:16108:"<div><div class="col-9">\n<div class="col-2 sidebar" style="margin-left: 0">\n<ul class="submenu">\n<li class="subcurrent">Intro</li>\n<li><a href="https://fr.wordpress.org/#precs">Pr&eacute;cisions pr&eacute;alables</a></li>\n<li><a href="https://fr.wordpress.org/regles-typographiques-de-base/#espaces_sign">Espaces et signes de ponctuation</a></li>\n<li><a href="https://fr.wordpress.org/regles-typographiques-de-base/#cas_ponct">Quelques cas particuliers pour la ponctuation</a></li>\n<li><a href="https://fr.wordpress.org/regles-typographiques-de-base/#abrev">Abr&eacute;viations</a></li>\n<li><a href="https://fr.wordpress.org/regles-typographiques-de-base/#accents">Accents</a></li>\n<li><a href="https://fr.wordpress.org/regles-typographiques-de-base/#ital">Italique</a></li>\n<li><a href="https://fr.wordpress.org/regles-typographiques-de-base/#nombres">Nombres</a></li>\n<li><a href="https://fr.wordpress.org/regles-typographiques-de-base/#maj">Majuscules</a></li>\n<li><a href="https://fr.wordpress.org/regles-typographiques-de-base/#abrev">Abr&eacute;viations</a></li>\n<li><a href="https://fr.wordpress.org/regles-typographiques-de-base/#res">Ressources sur les r&egrave;gles typographiques</a></li>\n<li><a href="https://fr.wordpress.org/regles-typographiques-de-base/#res_web">Ressources Web</a></li>\n<li><a href="https://fr.wordpress.org/regles-typographiques-de-base/#ouv">Ouvrages</a></li>\n<li><a href="https://fr.wordpress.org/regles-typographiques-de-base/#copy">Copyrights &amp; remerciements</a></li>\n</ul>\n</div>\n<div class="col-7">\n<p>Les r&egrave;gles pr&eacute;sent&eacute;es ici ont pour but d&rsquo;uniformiser le travail de traduction et donc sont &agrave; respecter le plus possible dans la traduction fran&ccedil;aise de WordPress.</p>\n<h2>Pr&eacute;cisions pr&eacute;alables</h2>\n<p><strong>Typographie</strong> : &laquo; (grec tupos, caract&egrave;re et graphein, &eacute;crire) : art d&rsquo;imprimer, du point de vue du style, de la disposition typographique et de la beaut&eacute; de la page imprim&eacute;e &raquo;.</p>\n<p><strong>Espace</strong> : &laquo; En typographie, le terme espace est f&eacute;minin ; mais dans la langue g&eacute;n&eacute;rale et en informatique, il est de genre masculin &raquo;.</p>\n<p>&laquo; En tapant une espace, on obtient un espace &raquo;.</p>\n<p><strong>Espace ins&eacute;cable</strong> : espace qui reste solidaire des mots qui le pr&eacute;c&egrave;dent et qui le suivent, permettant ainsi d&rsquo;&eacute;viter que des sauts de ligne surviennent &agrave; des endroits inappropri&eacute;s. &Agrave; utiliser notamment avant les signes de ponctuation doubles : deux-points, point d&rsquo;interrogation, point d&rsquo;exclamation.<br><a name="espaces_sign"></a></p>\n<h2>Espaces et signes de ponctuation</h2>\n<p><strong>Pas d&rsquo;espace avant, une espace apr&egrave;s</strong></p>\n<table class="widefat" dir="ltr" border="1" cellspacing="0" cellpadding="0">\n<colgroup>\n<col width="50%">\n<col width="50%">\n</colgroup>\n<tbody>\n<tr class="alt">\n<td>Signe</td>\n<td>Exemple</td>\n</tr>\n<tr>\n<td>point .</td>\n<td>La traduction est termin&eacute;e. Le language pack est g&eacute;n&eacute;r&eacute;.</td>\n</tr>\n<tr>\n<td>virgule ,</td>\n<td>La traduction est termin&eacute;e, le language pack est g&eacute;n&eacute;r&eacute;.</td>\n</tr>\n<tr>\n<td>points de suspension &hellip;</td>\n<td>En cours&hellip;</td>\n</tr>\n<tr>\n<td>parenth&egrave;se fermante )</td>\n<td>La traduction (ci-dessus) a &eacute;t&eacute; approuv&eacute;e par un GTE.</td>\n</tr>\n<tr>\n<td>crochet fermant ]</td>\n<td>Le GTE [Xavier] valide la trad.</td>\n</tr>\n<tr>\n<td>guillemets Anglais fermants &laquo;&nbsp;</td>\n<td>A man asks: &laquo;&nbsp;What time is break?&nbsp;&raquo;.</td>\n</tr>\n</tbody>\n</table>\n<p><strong>Une espace avant, pas d&rsquo;espace apr&egrave;s</strong></p>\n<table class="widefat" dir="ltr" border="1" cellspacing="0" cellpadding="0">\n<colgroup>\n<col width="50%">\n<col width="50%">\n</colgroup>\n<tbody>\n<tr class="alt">\n<td>Signe</td>\n<td>Exemple</td>\n</tr>\n<tr>\n<td>parenth&egrave;se ouvrante (</td>\n<td>La traduction (ci-dessus) a &eacute;t&eacute; approuv&eacute;e par un GTE.</td>\n</tr>\n<tr>\n<td>crochet ouvrant [</td>\n<td>Le GTE [Xavier] valide la trad.</td>\n</tr>\n<tr>\n<td>guillemets Anglais ouvrants &laquo;&nbsp;</td>\n<td>A man asks: &laquo;&nbsp;What time is break?&nbsp;&raquo;.</td>\n</tr>\n</tbody>\n</table>\n<p><strong>Une espace ins&eacute;cable avant, une espace apr&egrave;s</strong></p>\n<table class="widefat" dir="ltr" border="1" cellspacing="0" cellpadding="0">\n<colgroup>\n<col width="50%">\n<col width="50%">\n</colgroup>\n<tbody>\n<tr class="alt">\n<td>Signe</td>\n<td>Exemple</td>\n</tr>\n<tr>\n<td>deux points :</td>\n<td>La traduction est termin&eacute;e : le language pack est g&eacute;n&eacute;r&eacute;.</td>\n</tr>\n<tr>\n<td>point-virgule ;</td>\n<td>La traduction est termin&eacute;e ; le language pack est g&eacute;n&eacute;r&eacute;.</td>\n</tr>\n<tr>\n<td>point d&rsquo;interrogation ?</td>\n<td>Avez-vous des questions ? Direction les commentaires.</td>\n</tr>\n<tr>\n<td>point d&rsquo;exclamation !</td>\n<td>C&rsquo;est parfait&nbsp;!</td>\n</tr>\n<tr>\n<td>guillemets fran&ccedil;ais fermants &raquo;</td>\n<td>Un traducteur intervient : &laquo; O&ugrave; se trouve le glossaire ? &raquo;.</td>\n</tr>\n<tr>\n<td>pourcentage %</td>\n<td>La traduction est maintenant &agrave; 100 %.</td>\n</tr>\n<tr>\n<td>signes math&eacute;matiques</td>\n<td>x + y &ndash; z = u a &lt; b i ~ j</td>\n</tr>\n</tbody>\n</table>\n<p><strong>Une espace avant, une espace ins&eacute;cable apr&egrave;s</strong></p>\n<table class="widefat" dir="ltr" border="1" cellspacing="0" cellpadding="0">\n<colgroup>\n<col width="50%">\n<col width="50%">\n</colgroup>\n<tbody>\n<tr class="alt">\n<td>Signe</td>\n<td>Exemple</td>\n</tr>\n<tr>\n<td>guillemets fran&ccedil;ais ouvrants &laquo;</td>\n<td>Un traducteur intervient : &laquo; O&ugrave; se trouve le glossaire ? &raquo;.</td>\n</tr>\n</tbody>\n</table>\n<p><a name="cas_ponct"></a></p>\n<h3>Quelques cas particuliers pour la ponctuation</h3>\n<ul>\n<li>fin d&rsquo;une phrase : toujours un signe de ponctuation, point, point d&rsquo;interrogation ou point d&rsquo;exclamation ;</li>\n<li>fin d&rsquo;un titre de document ou de chapitre : pas de ponctuation (= tendance actuelle) ;</li>\n<li>dans une &eacute;num&eacute;ration : point-virgule apr&egrave;s chaque item de l&rsquo;&eacute;num&eacute;ration, mais point apr&egrave;s le dernier &eacute;l&eacute;ment s&rsquo;il correspond &agrave; la fin d&rsquo;une phrase ; dans les &eacute;num&eacute;rations imbriqu&eacute;es, point-virgule pour les &eacute;l&eacute;ments de niveau 1, virgule pour les &eacute;l&eacute;ments de niveau 2 ;</li>\n<li>apr&egrave;s &laquo; etc. &raquo; : pas de point de suspension ;</li>\n<li>entre les lettres d&rsquo;un sigle : pas de point.</li>\n</ul>\n<p><a href="https://fr.wordpress.org/files/2016/04/4-caracteres.jpg"><img class="aligncenter wp-image-447 size-medium" src="https://fr.wordpress.org/files/2016/04/4-caracteres-300x115.jpg" alt="Caract&egrave;res (props @hoffmanjeff)" width="300" height="115" srcset="https://fr.wordpress.org/files/2016/04/4-caracteres-300x115.jpg 300w, https://fr.wordpress.org/files/2016/04/4-caracteres-768x294.jpg 768w, https://fr.wordpress.org/files/2016/04/4-caracteres.jpg 1002w" sizes="(max-width: 300px) 100vw, 300px"></a></p>\n<p><a name="abrev"></a></p>\n<h2>Abr&eacute;viations</h2>\n<p><strong>Pr&eacute;sence ou non d&rsquo;un point final</strong></p>\n<ul>\n<li>pas de point si l&rsquo;abr&eacute;viation se termine par la derni&egrave;re lettre du mot.</li>\n</ul>\n<p>Exemple : &laquo; bd &raquo; pour boulevard.</p>\n<ul>\n<li>un point sinon.</li>\n</ul>\n<p>Exemple : &laquo; cat. &raquo; pour cat&eacute;gorie, &laquo; art. &raquo; pour article.</p>\n<p><strong>Titres de civilit&eacute;</strong></p>\n<ul>\n<li>Madame, Mademoiselle, Monsieur s&rsquo;abr&egrave;gent en Mme, Mlle, M.<br>\n&laquo; Mr &raquo; pour Monsieur est un anglicisme, et &laquo; Melle &raquo; pour Mademoiselle une graphie fautive ;</li>\n<li>Docteur s&rsquo;abr&egrave;ge en Dr, Professeur en Pr, Ma&icirc;tre en Me ;</li>\n<li>au pluriel Mmes Mlles, MM., Drs, Prs, Mes ;</li>\n<li>formes sans exposants tol&eacute;r&eacute;es : Mme, Mlle, Dr, Pr, Me, Mlles, Mmes&hellip;</li>\n</ul>\n<p><strong>Pluriel</strong></p>\n<ul>\n<li>abr&eacute;viations constitu&eacute;es avec des lettres sup&eacute;rieures : &laquo; s &raquo; au pluriel ;</li>\n<li>certains titres honorifiques : doublement de la consonne (MM.) ;</li>\n<li>autres abr&eacute;viations : pas de marque du pluriel.</li>\n<li>points cardinaux : initiale en majuscule N, S, O, E.</li>\n</ul>\n<p>Exemple : NE, SO, NE-SO, NNE-SSO.</p>\n<p><strong>Unit&eacute;s de mesure</strong> : voir le site du <a href="http://www1.bipm.org/fr/si/si_brochure">Bureau international des poids et mesure</a> (BIPM), (notamment le r&eacute;sum&eacute; de 4 pages &agrave; t&eacute;l&eacute;charger au format PDF).</p>\n<h2>Accents</h2>\n<p>Les majuscules doivent &ecirc;tre accentu&eacute;es, sauf pour les sigles.</p>\n<p>Exemple : &Eacute;tant donn&eacute; qu&rsquo;il est tard, nous allons faire une pause et laisser la place aux &eacute;l&egrave;ves de l&rsquo;&Eacute;cole nationale d&rsquo;administration (ENA).<br><a name="nombres"></a></p>\n<h2>Nombres</h2>\n<p>S&eacute;parateur de d&eacute;cimale : virgule (et pas un point).</p>\n<p>S&eacute;parateur de millier : espace ins&eacute;cable (et pas un point !).</p>\n<p>Ordinaux : 1er, 2e, 3e, etc. ou 1er, 2e, 3e, etc.</p>\n<p>Si&egrave;cle : chiffres romains en petites capitales : XXIe si&egrave;cle, forme sans exposant tol&eacute;r&eacute;e : XXIe si&egrave;cle.<br><a name="maj"></a></p>\n<h2>Majuscules</h2>\n<p><strong>R&egrave;gle de base</strong> : ne pas faire comme en anglais ou l&rsquo;emploi de majuscules est tr&egrave;s fr&eacute;quent, et adopter le point de vue inverse : tout &eacute;crire en minuscules sauf quand une majuscule est obligatoire, c&rsquo;est &agrave; dire et &agrave; la premi&egrave;re lettre de chaque phrase, la premi&egrave;re lettre des noms propres, et les sigles. Cette r&egrave;gle est &eacute;galement applicable aux titres de documents et de chapitres.</p>\n<p>Quelques indications sur ce qui est consid&eacute;r&eacute; comme nom propre, et donc sur l&rsquo;&eacute;criture de la premi&egrave;re lettre en majuscule ou en minuscule :</p>\n<p><strong>Personnes li&eacute;es &agrave; un lieu ou d&rsquo;une certaine couleur, langues</strong></p>\n<ul>\n<li>majuscule aux noms caract&eacute;risant des personnes, minuscules aux noms de langue et aux adjectifs.</li>\n</ul>\n<p>Exemple : Les polyglottes Fran&ccedil;ais parlent anglais avec les &eacute;tudiants chinois, mais peuvent parler fran&ccedil;ais avec les Roumains.</p>\n<ul>\n<li>si noms compos&eacute;s unis par un trait d&rsquo;union, majuscules aux deux.</li>\n</ul>\n<p>Exemple : Nord-Africains.</p>\n<p><strong>Qualit&eacute; de personnes</strong> : majuscule quand le terme exprimant la qualit&eacute; d&rsquo;une personne est employ&eacute; seul et d&eacute;signe une ou plusieurs personnes pr&eacute;cises, minuscule quand il est plac&eacute; devant le nom d&rsquo;une personne.</p>\n<p>Exemple : Le Doyen sera pr&eacute;sent. M. Leforestier, doyen, sera pr&eacute;sent.</p>\n<p><strong>Date</strong> : Les jours et les mois sont &agrave; &eacute;crire tout en minuscules.</p>\n<p>Exemple : Aujourd&rsquo;hui, vendredi 25 mars 2016, nous commen&ccedil;ons la formation.</p>\n<p>Exception : majuscule au mois dans les dates mentionn&eacute;es pour &eacute;voquer un &eacute;v&egrave;nement historique, quand l&rsquo;ann&eacute;e n&rsquo;est pas mentionn&eacute;e.</p>\n<p>Exemple : 14 Juillet, prise de la Bastille.</p>\n<p><strong>Sigles</strong></p>\n<ul>\n<li>tout en majuscules, mais usage actuel tendant &agrave; &eacute;crire seulement la 1&egrave;re lettre en majuscule pour les sigles qui peuvent se prononcer comme un mot (acronymes) et font plus de trois lettres.</li>\n</ul>\n<p>Exemple : CCFD, AUF, Unesco, Pnud.</p>\n<ul>\n<li>en minuscules quand ils sont devenus des noms communs.</li>\n</ul>\n<p>Exemple : laser, radar.</p>\n<p><strong>Noms d&rsquo;organismes</strong></p>\n<ul>\n<li>d&eacute;velopp&eacute; de sigle : majuscule &agrave; la 1&egrave;re lettre et aux noms propres.</li>\n</ul>\n<p>Exemple : Universit&eacute; libre de Bruxelles (ULB).</p>\n<ul>\n<li>sinon :</li>\n<li>organisme d&rsquo;&Eacute;tat multiple : trait&eacute; comme un nom commun = minuscule ; si accompagn&eacute; d&rsquo;un terme qui le caract&eacute;rise, majuscule &agrave; ce terme.</li>\n</ul>\n<p>Exemples : conseil municipal, minist&egrave;re des Affaires &eacute;trang&egrave;res.</p>\n<ul>\n<li>organisme d&rsquo;&Eacute;tat unique, organisme international : trait&eacute;s comme des noms propres = majuscule au nom ; si un adjectif pr&eacute;c&egrave;de le nom, majuscule &eacute;galement.</li>\n</ul>\n<p>Exemples : Archives nationales, Conseil des ministres, Haute Cour de justice.<br><a name="res"></a></p>\n<h2>Ressources sur les r&egrave;gles typographiques</h2>\n<p><a name="res_web"></a></p>\n<h3>Ressources Web</h3>\n<ol>\n<li>\n<a href="http://character-code.com/french-html-codes.php">Character-code.com</a> par Jeff Hoffman.</li>\n<li>&nbsp;<a href="http://tex.loria.fr/typographie/saudrais-typo.pdf">Le petit typographe rationnel</a> (15 pages), par Eddie Saudrais.</li>\n<li>\n<a href="http://www.infotheque.info/cache/9491/www.panamo.com/RESS/anglais.html">M&eacute;mento de typographie anglaise &agrave; l&rsquo;usage des r&eacute;dacteurs francophones</a>, par Dominique Lacroix archiv&eacute; dans l&rsquo;Infoth&egrave;que francophone.</li>\n<li>\n<a href="http://www.uzine.net/article1802.html">Petit guide typographique &agrave; l&rsquo;usage de l&rsquo;internet</a>, par Phynette et Arno.</li>\n<li>\n<a href="http://cahiers.gutenberg.eu.org/fitem?id=CG_1998___31_45_0">Petite histoire des signes de correction typographique</a> (15 pages), par Jacques Andr&eacute;.</li>\n<li>\n<a href="http://jacques-andre.fr/ed/index.html#lessons">Petites le&ccedil;ons de typographie</a> (50 pages), par Jacques Andr&eacute;.</li>\n<li>\n<a href="http://j.poitou.free.fr/pro/html/typ/typ-intro.html">Qu&rsquo;est-ce que la typographie ?</a> par Jacques Poitou.</li>\n<li>\n<a href="http://www.interpc.fr/mapage/billaud/ponctua.html">R&egrave;gles de ponctuation et de typographie</a>, par Jean-Fran&ccedil;ois Billaud.</li>\n<li>\n<a href="http://www.infotheque.info/ressource/8908.html">R&egrave;gles typographiques de base pour la pr&eacute;sentation d&rsquo;un document</a>, par Isabelle Maugis archiv&eacute; dans l&rsquo;Infoth&egrave;que francophone.</li>\n<li>\n<a href="http://www.framasoft.net/article2225.html">R&egrave;gles de typographie fran&ccedil;aise</a>, par Yves Perrousseaux.</li>\n<li><a href="http://www.synapse-fr.com/typographie/TTM_0.htm">Typographie.</a></li>\n</ol>\n<p><a name="ouv"></a></p>\n<h3>Ouvrages</h3>\n<p>Lexique des r&egrave;gles typographiques en usage &agrave; l&rsquo;Imprimerie Nationale. Paris : Imprimerie nationale, 2002. 196 p. ISBN 2-7433-0482-0</p>\n<p>GUERY, Louis. Dictionnaire des r&egrave;gles typographiques. 4e &eacute;d. Paris : Victoires &eacute;ditions, 2010. 282 p. ISBN : 978-2-35113-079-7</p>\n<p>GOURIOU, C. M&eacute;mento typographique. Paris : Cercle de la librairie, 1998. 121 p. ISBN 2-7654-0447-X</p>\n<p>CL&Eacute;MENT, Jean-Pierre. Dictionnaire typographique ou petit guide du tapeur &agrave; l&rsquo;usage de ceux qui tapent, saisissent ou composent textes, th&egrave;ses ou m&eacute;moires &agrave; l&rsquo;aide d&rsquo;un micro-ordinateur. Paris : Ellipses Marketing, 2005. 255 p. ISBN 2-7298-1998-3.<br><a name="copy"></a></p>\n<h2>Copyrights &amp; Remerciements</h2>\n<p>Fiche cr&eacute;&eacute;e le 9 octobre 2006, mise &agrave; jour le 12 ao&ucirc;t 2013.</p>\n<p>Copyright &copy; 2006-2013 V&eacute;ronique Pierre, veronique.pierre[chez]free.fr</p>\n<p>Certains droits r&eacute;serv&eacute;s, selon les termes du contrat Creative Commons BY-NC-SA 2.0 France.</p>\n<p>(Paternit&eacute; &ndash; Pas d&rsquo;utilisation commerciale &ndash; Partage des conditions initiales &agrave; l&rsquo;identique) http://creativecommons.org/licenses/by-nc-sa/2.0/fr/</p>\n</div>\n</div></div>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:2:{s:4:"date";a:1:{i:0;a:5:{s:4:"data";s:25:"2016-04-22T11:26:32+00:00";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:8:"fxbenard";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:16212:"<div><div class="col-9">\n<div class="col-2 sidebar" style="margin-left: 0">\n<ul class="submenu">\n<li class="subcurrent">Intro</li>\n<li><a href="https://fr.wordpress.org/#precs">Pr&eacute;cisions pr&eacute;alables</a></li>\n<li><a href="https://fr.wordpress.org/regles-typographiques-de-base/#espaces_sign">Espaces et signes de ponctuation</a></li>\n<li><a href="https://fr.wordpress.org/regles-typographiques-de-base/#cas_ponct">Quelques cas particuliers pour la ponctuation</a></li>\n<li><a href="https://fr.wordpress.org/regles-typographiques-de-base/#abrev">Abr&eacute;viations</a></li>\n<li><a href="https://fr.wordpress.org/regles-typographiques-de-base/#accents">Accents</a></li>\n<li><a href="https://fr.wordpress.org/regles-typographiques-de-base/#ital">Italique</a></li>\n<li><a href="https://fr.wordpress.org/regles-typographiques-de-base/#nombres">Nombres</a></li>\n<li><a href="https://fr.wordpress.org/regles-typographiques-de-base/#maj">Majuscules</a></li>\n<li><a href="https://fr.wordpress.org/regles-typographiques-de-base/#abrev">Abr&eacute;viations</a></li>\n<li><a href="https://fr.wordpress.org/regles-typographiques-de-base/#res">Ressources sur les r&egrave;gles typographiques</a></li>\n<li><a href="https://fr.wordpress.org/regles-typographiques-de-base/#res_web">Ressources Web</a></li>\n<li><a href="https://fr.wordpress.org/regles-typographiques-de-base/#ouv">Ouvrages</a></li>\n<li><a href="https://fr.wordpress.org/regles-typographiques-de-base/#copy">Copyrights &amp; remerciements</a></li>\n</ul>\n</div>\n<div class="col-7">\n<p>Les r&egrave;gles pr&eacute;sent&eacute;es ici ont pour but d&rsquo;uniformiser le travail de traduction et donc sont &agrave; respecter le plus possible dans la traduction fran&ccedil;aise de WordPress.</p>\n<h2>Pr&eacute;cisions pr&eacute;alables</h2>\n<p><strong>Typographie</strong> : &laquo; (grec tupos, caract&egrave;re et graphein, &eacute;crire) : art d&rsquo;imprimer, du point de vue du style, de la disposition typographique et de la beaut&eacute; de la page imprim&eacute;e &raquo;.</p>\n<p><strong>Espace</strong> : &laquo; En typographie, le terme espace est f&eacute;minin ; mais dans la langue g&eacute;n&eacute;rale et en informatique, il est de genre masculin &raquo;.</p>\n<p>&laquo; En tapant une espace, on obtient un espace &raquo;.</p>\n<p><strong>Espace ins&eacute;cable</strong> : espace qui reste solidaire des mots qui le pr&eacute;c&egrave;dent et qui le suivent, permettant ainsi d&rsquo;&eacute;viter que des sauts de ligne surviennent &agrave; des endroits inappropri&eacute;s. &Agrave; utiliser notamment avant les signes de ponctuation doubles : deux-points, point d&rsquo;interrogation, point d&rsquo;exclamation.<br><a name="espaces_sign"></a></p>\n<h2>Espaces et signes de ponctuation</h2>\n<p><strong>Pas d&rsquo;espace avant, une espace apr&egrave;s</strong></p>\n<table class="widefat" dir="ltr" border="1" cellspacing="0" cellpadding="0">\n<colgroup>\n<col width="50%">\n<col width="50%">\n</colgroup>\n<tbody>\n<tr class="alt">\n<td>Signe</td>\n<td>Exemple</td>\n</tr>\n<tr>\n<td>point .</td>\n<td>La traduction est termin&eacute;e. Le language pack est g&eacute;n&eacute;r&eacute;.</td>\n</tr>\n<tr>\n<td>virgule ,</td>\n<td>La traduction est termin&eacute;e, le language pack est g&eacute;n&eacute;r&eacute;.</td>\n</tr>\n<tr>\n<td>points de suspension &hellip;</td>\n<td>En cours&hellip;</td>\n</tr>\n<tr>\n<td>parenth&egrave;se fermante )</td>\n<td>La traduction (ci-dessus) a &eacute;t&eacute; approuv&eacute;e par un GTE.</td>\n</tr>\n<tr>\n<td>crochet fermant ]</td>\n<td>Le GTE [Xavier] valide la trad.</td>\n</tr>\n<tr>\n<td>guillemets Anglais fermants &laquo;&nbsp;</td>\n<td>A man asks: &laquo;&nbsp;What time is break?&nbsp;&raquo;.</td>\n</tr>\n</tbody>\n</table>\n<p><strong>Une espace avant, pas d&rsquo;espace apr&egrave;s</strong></p>\n<table class="widefat" dir="ltr" border="1" cellspacing="0" cellpadding="0">\n<colgroup>\n<col width="50%">\n<col width="50%">\n</colgroup>\n<tbody>\n<tr class="alt">\n<td>Signe</td>\n<td>Exemple</td>\n</tr>\n<tr>\n<td>parenth&egrave;se ouvrante (</td>\n<td>La traduction (ci-dessus) a &eacute;t&eacute; approuv&eacute;e par un GTE.</td>\n</tr>\n<tr>\n<td>crochet ouvrant [</td>\n<td>Le GTE [Xavier] valide la trad.</td>\n</tr>\n<tr>\n<td>guillemets Anglais ouvrants &laquo;&nbsp;</td>\n<td>A man asks: &laquo;&nbsp;What time is break?&nbsp;&raquo;.</td>\n</tr>\n</tbody>\n</table>\n<p><strong>Une espace ins&eacute;cable avant, une espace apr&egrave;s</strong></p>\n<table class="widefat" dir="ltr" border="1" cellspacing="0" cellpadding="0">\n<colgroup>\n<col width="50%">\n<col width="50%">\n</colgroup>\n<tbody>\n<tr class="alt">\n<td>Signe</td>\n<td>Exemple</td>\n</tr>\n<tr>\n<td>deux points :</td>\n<td>La traduction est termin&eacute;e : le language pack est g&eacute;n&eacute;r&eacute;.</td>\n</tr>\n<tr>\n<td>point-virgule ;</td>\n<td>La traduction est termin&eacute;e ; le language pack est g&eacute;n&eacute;r&eacute;.</td>\n</tr>\n<tr>\n<td>point d&rsquo;interrogation ?</td>\n<td>Avez-vous des questions ? Direction les commentaires.</td>\n</tr>\n<tr>\n<td>point d&rsquo;exclamation !</td>\n<td>C&rsquo;est parfait&nbsp;!</td>\n</tr>\n<tr>\n<td>guillemets fran&ccedil;ais fermants &raquo;</td>\n<td>Un traducteur intervient : &laquo; O&ugrave; se trouve le glossaire ? &raquo;.</td>\n</tr>\n<tr>\n<td>pourcentage %</td>\n<td>La traduction est maintenant &agrave; 100 %.</td>\n</tr>\n<tr>\n<td>signes math&eacute;matiques</td>\n<td>x + y &ndash; z = u a &lt; b i ~ j</td>\n</tr>\n</tbody>\n</table>\n<p><strong>Une espace avant, une espace ins&eacute;cable apr&egrave;s</strong></p>\n<table class="widefat" dir="ltr" border="1" cellspacing="0" cellpadding="0">\n<colgroup>\n<col width="50%">\n<col width="50%">\n</colgroup>\n<tbody>\n<tr class="alt">\n<td>Signe</td>\n<td>Exemple</td>\n</tr>\n<tr>\n<td>guillemets fran&ccedil;ais ouvrants &laquo;</td>\n<td>Un traducteur intervient : &laquo; O&ugrave; se trouve le glossaire ? &raquo;.</td>\n</tr>\n</tbody>\n</table>\n<p><a name="cas_ponct"></a></p>\n<h3>Quelques cas particuliers pour la ponctuation</h3>\n<ul>\n<li>fin d&rsquo;une phrase : toujours un signe de ponctuation, point, point d&rsquo;interrogation ou point d&rsquo;exclamation ;</li>\n<li>fin d&rsquo;un titre de document ou de chapitre : pas de ponctuation (= tendance actuelle) ;</li>\n<li>dans une &eacute;num&eacute;ration : point-virgule apr&egrave;s chaque item de l&rsquo;&eacute;num&eacute;ration, mais point apr&egrave;s le dernier &eacute;l&eacute;ment s&rsquo;il correspond &agrave; la fin d&rsquo;une phrase ; dans les &eacute;num&eacute;rations imbriqu&eacute;es, point-virgule pour les &eacute;l&eacute;ments de niveau 1, virgule pour les &eacute;l&eacute;ments de niveau 2 ;</li>\n<li>apr&egrave;s &laquo; etc. &raquo; : pas de point de suspension ;</li>\n<li>entre les lettres d&rsquo;un sigle : pas de point.</li>\n</ul>\n<p><a href="https://fr.wordpress.org/files/2016/04/4-caracteres.jpg"><img class="aligncenter wp-image-447 size-medium" src="https://fr.wordpress.org/files/2016/04/4-caracteres-300x115.jpg" alt="Caract&egrave;res (props @hoffmanjeff)" width="300" height="115" srcset="https://fr.wordpress.org/files/2016/04/4-caracteres-300x115.jpg 300w, https://fr.wordpress.org/files/2016/04/4-caracteres-768x294.jpg 768w, https://fr.wordpress.org/files/2016/04/4-caracteres.jpg 1002w" sizes="(max-width: 300px) 100vw, 300px"></a></p>\n<p><a name="abrev"></a></p>\n<h2>Abr&eacute;viations</h2>\n<p><strong>Pr&eacute;sence ou non d&rsquo;un point final</strong></p>\n<ul>\n<li>pas de point si l&rsquo;abr&eacute;viation se termine par la derni&egrave;re lettre du mot.</li>\n</ul>\n<p>Exemple : &laquo; bd &raquo; pour boulevard.</p>\n<ul>\n<li>un point sinon.</li>\n</ul>\n<p>Exemple : &laquo; cat. &raquo; pour cat&eacute;gorie, &laquo; art. &raquo; pour article.</p>\n<p><strong>Titres de civilit&eacute;</strong></p>\n<ul>\n<li>Madame, Mademoiselle, Monsieur s&rsquo;abr&egrave;gent en Mme, Mlle, M.<br>\n&laquo; Mr &raquo; pour Monsieur est un anglicisme, et &laquo; Melle &raquo; pour Mademoiselle une graphie fautive ;</li>\n<li>Docteur s&rsquo;abr&egrave;ge en Dr, Professeur en Pr, Ma&icirc;tre en Me ;</li>\n<li>au pluriel Mmes Mlles, MM., Drs, Prs, Mes ;</li>\n<li>formes sans exposants tol&eacute;r&eacute;es : Mme, Mlle, Dr, Pr, Me, Mlles, Mmes&hellip;</li>\n</ul>\n<p><strong>Pluriel</strong></p>\n<ul>\n<li>abr&eacute;viations constitu&eacute;es avec des lettres sup&eacute;rieures : &laquo; s &raquo; au pluriel ;</li>\n<li>certains titres honorifiques : doublement de la consonne (MM.) ;</li>\n<li>autres abr&eacute;viations : pas de marque du pluriel.</li>\n<li>points cardinaux : initiale en majuscule N, S, O, E.</li>\n</ul>\n<p>Exemple : NE, SO, NE-SO, NNE-SSO.</p>\n<p><strong>Unit&eacute;s de mesure</strong> : voir le site du <a href="http://www1.bipm.org/fr/si/si_brochure">Bureau international des poids et mesure</a> (BIPM), (notamment le r&eacute;sum&eacute; de 4 pages &agrave; t&eacute;l&eacute;charger au format PDF).</p>\n<h2>Accents</h2>\n<p>Les majuscules doivent &ecirc;tre accentu&eacute;es, sauf pour les sigles.</p>\n<p>Exemple : &Eacute;tant donn&eacute; qu&rsquo;il est tard, nous allons faire une pause et laisser la place aux &eacute;l&egrave;ves de l&rsquo;&Eacute;cole nationale d&rsquo;administration (ENA).<br><a name="nombres"></a></p>\n<h2>Nombres</h2>\n<p>S&eacute;parateur de d&eacute;cimale : virgule (et pas un point).</p>\n<p>S&eacute;parateur de millier : espace ins&eacute;cable (et pas un point !).</p>\n<p>Ordinaux : 1er, 2e, 3e, etc. ou 1er, 2e, 3e, etc.</p>\n<p>Si&egrave;cle : chiffres romains en petites capitales : XXIe si&egrave;cle, forme sans exposant tol&eacute;r&eacute;e : XXIe si&egrave;cle.<br><a name="maj"></a></p>\n<h2>Majuscules</h2>\n<p><strong>R&egrave;gle de base</strong> : ne pas faire comme en anglais ou l&rsquo;emploi de majuscules est tr&egrave;s fr&eacute;quent, et adopter le point de vue inverse : tout &eacute;crire en minuscules sauf quand une majuscule est obligatoire, c&rsquo;est &agrave; dire et &agrave; la premi&egrave;re lettre de chaque phrase, la premi&egrave;re lettre des noms propres, et les sigles. Cette r&egrave;gle est &eacute;galement applicable aux titres de documents et de chapitres.</p>\n<p>Quelques indications sur ce qui est consid&eacute;r&eacute; comme nom propre, et donc sur l&rsquo;&eacute;criture de la premi&egrave;re lettre en majuscule ou en minuscule :</p>\n<p><strong>Personnes li&eacute;es &agrave; un lieu ou d&rsquo;une certaine couleur, langues</strong></p>\n<ul>\n<li>majuscule aux noms caract&eacute;risant des personnes, minuscules aux noms de langue et aux adjectifs.</li>\n</ul>\n<p>Exemple : Les polyglottes Fran&ccedil;ais parlent anglais avec les &eacute;tudiants chinois, mais peuvent parler fran&ccedil;ais avec les Roumains.</p>\n<ul>\n<li>si noms compos&eacute;s unis par un trait d&rsquo;union, majuscules aux deux.</li>\n</ul>\n<p>Exemple : Nord-Africains.</p>\n<p><strong>Qualit&eacute; de personnes</strong> : majuscule quand le terme exprimant la qualit&eacute; d&rsquo;une personne est employ&eacute; seul et d&eacute;signe une ou plusieurs personnes pr&eacute;cises, minuscule quand il est plac&eacute; devant le nom d&rsquo;une personne.</p>\n<p>Exemple : Le Doyen sera pr&eacute;sent. M. Leforestier, doyen, sera pr&eacute;sent.</p>\n<p><strong>Date</strong> : Les jours et les mois sont &agrave; &eacute;crire tout en minuscules.</p>\n<p>Exemple : Aujourd&rsquo;hui, vendredi 25 mars 2016, nous commen&ccedil;ons la formation.</p>\n<p>Exception : majuscule au mois dans les dates mentionn&eacute;es pour &eacute;voquer un &eacute;v&egrave;nement historique, quand l&rsquo;ann&eacute;e n&rsquo;est pas mentionn&eacute;e.</p>\n<p>Exemple : 14 Juillet, prise de la Bastille.</p>\n<p><strong>Sigles</strong></p>\n<ul>\n<li>tout en majuscules, mais usage actuel tendant &agrave; &eacute;crire seulement la 1&egrave;re lettre en majuscule pour les sigles qui peuvent se prononcer comme un mot (acronymes) et font plus de trois lettres.</li>\n</ul>\n<p>Exemple : CCFD, AUF, Unesco, Pnud.</p>\n<ul>\n<li>en minuscules quand ils sont devenus des noms communs.</li>\n</ul>\n<p>Exemple : laser, radar.</p>\n<p><strong>Noms d&rsquo;organismes</strong></p>\n<ul>\n<li>d&eacute;velopp&eacute; de sigle : majuscule &agrave; la 1&egrave;re lettre et aux noms propres.</li>\n</ul>\n<p>Exemple : Universit&eacute; libre de Bruxelles (ULB).</p>\n<ul>\n<li>sinon :</li>\n<li>organisme d&rsquo;&Eacute;tat multiple : trait&eacute; comme un nom commun = minuscule ; si accompagn&eacute; d&rsquo;un terme qui le caract&eacute;rise, majuscule &agrave; ce terme.</li>\n</ul>\n<p>Exemples : conseil municipal, minist&egrave;re des Affaires &eacute;trang&egrave;res.</p>\n<ul>\n<li>organisme d&rsquo;&Eacute;tat unique, organisme international : trait&eacute;s comme des noms propres = majuscule au nom ; si un adjectif pr&eacute;c&egrave;de le nom, majuscule &eacute;galement.</li>\n</ul>\n<p>Exemples : Archives nationales, Conseil des ministres, Haute Cour de justice.<br><a name="res"></a></p>\n<h2>Ressources sur les r&egrave;gles typographiques</h2>\n<p><a name="res_web"></a></p>\n<h3>Ressources Web</h3>\n<ol>\n<li>\n<a href="http://character-code.com/french-html-codes.php">Character-code.com</a> par Jeff Hoffman.</li>\n<li>&nbsp;<a href="http://tex.loria.fr/typographie/saudrais-typo.pdf">Le petit typographe rationnel</a> (15 pages), par Eddie Saudrais.</li>\n<li>\n<a href="http://www.infotheque.info/cache/9491/www.panamo.com/RESS/anglais.html">M&eacute;mento de typographie anglaise &agrave; l&rsquo;usage des r&eacute;dacteurs francophones</a>, par Dominique Lacroix archiv&eacute; dans l&rsquo;Infoth&egrave;que francophone.</li>\n<li>\n<a href="http://www.uzine.net/article1802.html">Petit guide typographique &agrave; l&rsquo;usage de l&rsquo;internet</a>, par Phynette et Arno.</li>\n<li>\n<a href="http://cahiers.gutenberg.eu.org/fitem?id=CG_1998___31_45_0">Petite histoire des signes de correction typographique</a> (15 pages), par Jacques Andr&eacute;.</li>\n<li>\n<a href="http://jacques-andre.fr/ed/index.html#lessons">Petites le&ccedil;ons de typographie</a> (50 pages), par Jacques Andr&eacute;.</li>\n<li>\n<a href="http://j.poitou.free.fr/pro/html/typ/typ-intro.html">Qu&rsquo;est-ce que la typographie ?</a> par Jacques Poitou.</li>\n<li>\n<a href="http://www.interpc.fr/mapage/billaud/ponctua.html">R&egrave;gles de ponctuation et de typographie</a>, par Jean-Fran&ccedil;ois Billaud.</li>\n<li>\n<a href="http://www.infotheque.info/ressource/8908.html">R&egrave;gles typographiques de base pour la pr&eacute;sentation d&rsquo;un document</a>, par Isabelle Maugis archiv&eacute; dans l&rsquo;Infoth&egrave;que francophone.</li>\n<li>\n<a href="http://www.framasoft.net/article2225.html">R&egrave;gles de typographie fran&ccedil;aise</a>, par Yves Perrousseaux.</li>\n<li><a href="http://www.synapse-fr.com/typographie/TTM_0.htm">Typographie.</a></li>\n</ol>\n<p><a name="ouv"></a></p>\n<h3>Ouvrages</h3>\n<p>Lexique des r&egrave;gles typographiques en usage &agrave; l&rsquo;Imprimerie Nationale. Paris : Imprimerie nationale, 2002. 196 p. ISBN 2-7433-0482-0</p>\n<p>GUERY, Louis. Dictionnaire des r&egrave;gles typographiques. 4e &eacute;d. Paris : Victoires &eacute;ditions, 2010. 282 p. ISBN : 978-2-35113-079-7</p>\n<p>GOURIOU, C. M&eacute;mento typographique. Paris : Cercle de la librairie, 1998. 121 p. ISBN 2-7654-0447-X</p>\n<p>CL&Eacute;MENT, Jean-Pierre. Dictionnaire typographique ou petit guide du tapeur &agrave; l&rsquo;usage de ceux qui tapent, saisissent ou composent textes, th&egrave;ses ou m&eacute;moires &agrave; l&rsquo;aide d&rsquo;un micro-ordinateur. Paris : Ellipses Marketing, 2005. 255 p. ISBN 2-7298-1998-3.<br><a name="copy"></a></p>\n<h2>Copyrights &amp; Remerciements</h2>\n<p>Fiche cr&eacute;&eacute;e le 9 octobre 2006, mise &agrave; jour le 12 ao&ucirc;t 2013.</p>\n<p>Copyright &copy; 2006-2013 V&eacute;ronique Pierre, veronique.pierre[chez]free.fr</p>\n<p>Certains droits r&eacute;serv&eacute;s, selon les termes du contrat Creative Commons BY-NC-SA 2.0 France.</p>\n<p>(Paternit&eacute; &ndash; Pas d&rsquo;utilisation commerciale &ndash; Partage des conditions initiales &agrave; l&rsquo;identique) http://creativecommons.org/licenses/by-nc-sa/2.0/fr/</p>\n</div>\n</div></div><img src="http://feeds.feedburner.com/~r/wordpress-fr/RaoY/~4/WNwSXxGC3kw" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:66:"https://fr.wordpress.org/2016/04/22/regles-typographiques-de-base/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}}}}}}}}s:4:"type";i:64;s:7:"headers";a:10:{s:12:"content-type";s:23:"text/xml; charset=UTF-8";s:4:"etag";s:27:"BXyTz+nwUcY8z/OuzCWEfxSNw8E";s:13:"last-modified";s:29:"Fri, 27 May 2016 14:35:20 GMT";s:16:"content-encoding";s:4:"gzip";s:4:"date";s:29:"Fri, 27 May 2016 15:05:04 GMT";s:7:"expires";s:29:"Fri, 27 May 2016 15:05:04 GMT";s:13:"cache-control";s:18:"private, max-age=0";s:22:"x-content-type-options";s:7:"nosniff";s:16:"x-xss-protection";s:13:"1; mode=block";s:6:"server";s:3:"GSE";}s:5:"build";s:14:"20130911080210";}', 'no');
